ce-unknown',_binary 's:52:\"Source: <span class=\"apihelp-unknown\">unknown</span>\";'),(_binary 'en',_binary 'messages:api-help-templatedparams',_binary 's:560:\"Templated parameters support cases where an API module needs a value for each value of some other parameter. For example, if there were an API module to request fruit, it might have a parameter <var>fruits</var> to specify which fruits are being requested and a templated parameter <var>{fruit}-quantity</var> to specify how many of each fruit to request. An API client that wants 1 apple, 5 bananas, and 20 strawberries could then make a request like <kbd>fruits=apples|bananas|strawberries&apples-quantity=1&bananas-quantity=5&strawberries-quantity=20</kbd>.\";'),(_binary 'en',_binary 'messages:api-help-templatedparams-header',_binary 's:20:\"Templated parameters\";'),(_binary 'en',_binary 'messages:api-help-title',_binary 's:18:\"MediaWiki API help\";'),(_binary 'en',_binary 'messages:api-help-undocumented-module',_binary 's:31:\"No documentation for module $1.\";'),(_binary 'en',_binary 'messages:api-login-fail-aborted',_binary 's:277:\"Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To be able to login with <kbd>action=login</kbd>, see [[Special:BotPasswords]]. To continue using main-account login, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),(_binary 'en',_binary 'messages:api-login-fail-aborted-nobotpw',_binary 's:170:\"Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To log in, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),(_binary 'en',_binary 'messages:api-login-fail-badsessionprovider',_binary 's:28:\"Cannot log in when using $1.\";'),(_binary 'en',_binary 'messages:api-login-fail-sameorigin',_binary 's:57:\"Cannot log in when the same-origin policy is not applied.\";'),(_binary 'en',_binary 'messages:api-pageset-param-converttitles',_binary 's:171:\"Convert tit