help-parse-paramvalue-prop-iwlinks',_binary 's:45:\"Gives interwiki links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-jsconfigvars',_binary 's:110:\"Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-langlinks',_binary 's:48:\"Gives the language links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-limitreportdata',_binary 's:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-limitreporthtml',_binary 's:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-links',_binary 's:48:\"Gives the internal links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-modules',_binary 's:211:\"Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-parsetree',_binary 's:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-parsewarnings',_binary 's:55:\"Gives the warnings that occurred while parsing content.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-properties',_binary 's:56:\"Gives various properties defined in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-revid',_binary 's:40:\"Adds the revision ID of the parsed page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-sections',_binary 