ary 's:16:\"Removed settings\";'),(_binary 'en',_binary 'messages:smw-admin-deprecation-notice-title-removal-explanation',_binary 's:102:\"Listed settings were removed in a previous release but have yet been detected to be used on this wiki.\";'),(_binary 'en',_binary 'messages:smw-admin-deprecation-notice-title-replacement',_binary 's:28:\"Replaced or renamed settings\";'),(_binary 'en',_binary 'messages:smw-admin-deprecation-notice-title-replacement-explanation',_binary 's:143:\"The following section contains settings that were renamed or otherwise modified and it is recommended to forthwith update their name or format.\";'),(_binary 'en',_binary 'messages:smw-admin-docu',_binary 's:311:\"This special page helps you during installation, upgrade, maintenance and usage of <a href=\"https://www.semantic-mediawiki.org\">Semantic MediaWiki</a> and also provides further administrative functions and tasks as well as statistics.\nRemember to back up valuable data before executing administrative functions.\";'),(_binary 'en',_binary 'messages:smw-admin-environment',_binary 's:20:\"Software environment\";'),(_binary 'en',_binary 'messages:smw-admin-feature-disabled',_binary 's:197:\"This feature has been disabled on this wiki, please consult the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:$smwgAdminFeatures\">settings</a> help page or contact the system administrator.\";'),(_binary 'en',_binary 'messages:smw-admin-fulltext-active',_binary 's:50:\"A full-text search rebuild job has been scheduled.\";'),(_binary 'en',_binary 'messages:smw-admin-fulltext-button',_binary 's:26:\"Schedule full-text rebuild\";'),(_binary 'en',_binary 'messages:smw-admin-fulltext-intro',_binary 's:280:\"Rebuilds the search index from property tables with an enabled [https://www.semantic-mediawiki.org/wiki/Full-text full-text search] datatype. Changes to the index rules (altered stopwords, new stemmer etc.) and/or a newly added or altered table does require to run this job again.\";'),(_binary 'en',_binary 'messages:smw-admin-fulltext-title',_binary 's:24:\"Full-text search rebuild\";'),(_binary 'en',_binary 'messages:smw-admin-iddispose-docu',_binary 's:342:\"It should be noted that the disposal operation is unrestricted and will remove the entity from the storage engine together with all its references in pending tables, if confirmed. Please perform this task with \'\'\'caution\'\'\' and only after the [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal documentation] has been consulted.\";'),(_binary 'en',_binary 'messages:smw-admin-iddispose-done',_binary 's:45:\"ID \"$1\" was removed from the storage backend.\";'),(_binary 'en',_binary 'messages:smw-admin-iddispose-no-references',_binary 's:53:\"The search was unable to match \"$1\" to a table entry.\";'),(_binary 'en',_binary 'messages:smw-admin-iddispose-references',_binary 's:59:\"ID \"$1\" has {{PLURAL:$2|no|at least one}} active reference:\";'),(_binary 'en',_binary 'messages:smw-admin-iddispose-references-multiple',_binary 's:58:\"List of matches with at least one active reference record.\";'),(_binary 'en',_binary 'messages:smw-admin-iddispose-title',_binary 's:8:\"Disposal\";'),(_binary 'en',_binary 'messages:smw-admin-idlookup-docu',_binary 's:303:\"This section shows technical details about an individual entity (wikipage, subobject, property, etc.) in Semantic MediaWiki. The input can be a numeric ID or a string value to match the relevant search field, yet any ID reference relates to Semantic MediaWiki and not to MediaWiki\'s page or revision ID.\";'),(_binary 'en',_binary 'messages:smw-admin-idlookup-input',_binary 's:7:\"Search:\";'),(_binary 'en',_binary 'messages:smw-admin-idlookup-title',_binary 's:6:\"Lookup\";'),(_binary 'en',_binary 'messages:smw-admin-installfile',_binary 's:299:\"If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md\">INSTALL file</a> and the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:Installation\">installation page</a>.\";'),(_binary 'en',_binary 'messages:smw-admin-job-scheduler-note',_binary 's:369:\"Most activities in this section are performed as jobs to avoid deadlock situations during their execution. The [https://www.mediawiki.org/wiki/Manual:Job_queue job scheduler] is responsible for the processing and it is critical that maintenance script <code>runJobs.php</code> (see also configuration parameter <code>$wgRunJobsAsync</code>) has an appropriate capacity.\";'),(_binary 'en',_binary 'messages:smw-admin-objectid',_binary 's:3:\"ID:\";'),(_binary 'en',_binary 'messages:smw-admin-operational-statistics',_binary 's:194:\"This page contains operational statistics collected in or from Semantic MediaWiki related functions. An extended list of wiki specific statistics can be found [[Special:Statistics|<b>here</b>]].\";'),(_binary 'en',_binary 'messages:smw-admin-other-functions',_binary 's:15:\"Other functions\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-active',_binary 's:53:\"An outdated entities disposal job has been scheduled.\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-button',_binary 's:17:\"Schedule disposal\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-intro',_binary 's:279:\"Some activities (a change to a property type, the removal of wikipages, or the correction of error values) will result in [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and it is suggested to remove them periodically to free associated table space.\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-title',_binary 's:26:\"Outdated entities disposal\";'),(_binary 'en',_binary 'messages:smw-admin-permission-missing',_binary 's:210:\"The access to this page has been blocked due to missing permissions, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Permissions permissions] help page for details about the necessary settings.\";'),(_binary 'en',_binary 'messages:smw-admin-permissionswarn',_binary 's:432:\"If the operation fails with SQL errors, the database user employed by your wiki (check your \"LocalSettings.php\" file) probably does not have sufficient permissions.\nEither grant this user additional permissions to create and delete tables, temporarily enter the login of your database root in the \"LocalSettings.php\" file, or use the maintenance script <code>setupStore.php</code>, which can use the credentials of an administrator.\";'),(_binary 'en',_binary 'messages:smw-admin-propertystatistics-active',_binary 's:53:\"A property statistics rebuild job has been scheduled.\";'),(_binary 'en',_binary 'messages:smw-admin-propertystatistics-button',_binary 's:27:\"Schedule statistics rebuild\";'),(_binary 'en',_binary 'messages:smw-admin-propertystatistics-intro',_binary 's:177:\"Rebuilds the entire property usage statistics and therein updates and corrects the [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count] of properties.\";'),(_binary 'en',_binary 'messages:smw-admin-propertystatistics-title',_binary 's:27:\"Property statistics rebuild\";'),(_binary 'en',_binary 'messages:smw-admin-questions',_binary 's:286:\"If you have further questions or suggestions, join the discussion on the Semantic MediaWiki <a href=\"https://sourceforge.net/p/semediawiki/mailman/semediawiki-user/\">user mailing list</a> or the <a href=\"https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki_chatroom\">chatroom</a>.\";'),(_binary 'en',_binary 'messages:smw-admin-settings-docu',_binary 's:251:\"Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),(_binary 'en',_binary 'messages:smw-admin-setupsuccess',_binary 's:30:\"The storage engine was set up.\";'),(_binary 'en',_binary 'messages:smw-admin-smwhomepage',_binary 's:139:\"The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://www.semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-job-docu',_binary 's:288:\"The job statistics displays information about scheduled Semantic MediaWiki jobs that have not yet been executed. The number of jobs may be slightly inaccurate or contains failed attempts, please consult the [https://www.mediawiki.org/wiki/Manual:Job_queue manual] for further information.\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-job-title',_binary 's:14:\"Job statistics\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-querycache-disabled',_binary 's:141:\"The [https://www.semantic-mediawiki.org/wiki/QueryCache QueryCache] has not been enabled on this wiki and hereby no statistics are available.\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-querycache-explain',_binary 's:869:\"The cache statistics is to contain provisional cumulative as well as derived data including: \n* \"misses\" as the total attempts to retrieve data from the cache with unattainable responses, forcing a direct repository (DB, triple-store etc.) retrieval \n* \"deletes\" as the total amount of cache eviction operations (either through a purge or query dependency) \n* \"hits\" contains the amount of cache retrievals from either embedded (queries called from within a wiki page) or non-embedded (if enabled, requested by pages like Special:Ask or the API) sources \n* \"medianRetrievalResponseTime\" is an orientation value of the median response time (in sec.) for cached and non-cached retrieval requests over the time span of the collection process  \n* \"noCache\" indicates the amount of no attempt requests (limit=0 queries, \'no-cache\' option etc.) to retrieve results from cache\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-querycache-title',_binary 's:22:\"Query cache statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-docu',_binary 's:322:\"This page lists entries from the [https://www.semantic-mediawiki.org/wiki/Help:Entity_table entity table] that have been categorized as duplicates. Duplicate entries should (if at all) only occur on rare occasions potentially caused by a terminated process during a database update or an unsuccessful rollback transaction.\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-helplink',_binary 's:63:\"https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-intro',_binary 's:91:\"<u>$1</u> to list entries that are categorized as to contain duplicates in the entity table\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-title',_binary 's:18:\"Duplicate entities\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-docu',_binary 's:256:\"This page contains information about settings, mappings, health, and index statistics related to an Elasticsearch cluster that is connected to Semantic MediaWiki and its [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore <code>ElasticStore</code>].\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-functions',_binary 's:19:\"Available functions\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-indices-intro',_binary 's:72:\"<u>$1</u> provides an overview of available indices and their statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-indices-title',_binary 's:7:\"Indices\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-intro',_binary 's:53:\"<u>$1</u> informs about settings and index statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-mappings-docu',_binary 's:250:\"This page contains field mapping details as there are used with the current i