s://www.semantic-mediawiki.org/wiki/Help:Container container] that may include a reference to the property that caused the discrepancy.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-long-errp',_binary 's:95:\"In most cases it is caused by a type mismatch or a [[Property:Allows value|value]] restriction.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-long-pefu',_binary 's:174:\"The URI is expected to contain a placeholder that will be adjusted with an [[Special:Types/External identifier|external identifier]] value to form a valid resource reference.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-long-pvuc',_binary 's:154:\"Uniqueness is established when two values are not equal in their literal representation and any violation of that constraint will be categorized as error.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-long-schema-tag',_binary 's:71:\"A label that identifies schemata of similar content or characteristics.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-long-schema-type',_binary 's:262:\"Each [https://www.semantic-mediawiki.org/wiki/Help:Schema/Type type] is expected to provide its own interpretation of syntax elements and constraints and expresses those through a [https://www.semantic-mediawiki.org/wiki/Help:Schema#validation validation model].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-long-sobj',_binary 's:180:\"The container allows to accumulate property-value assignments similar to that of a normal wiki page but within a different entity space while being linked to the embedding subject.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-mdat',_binary 's:201:\"\"$1\" is a predefined property that corresponds to the date of the last modification of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-media',_binary 's:184:\"\"$1\" is a predefined property that describes the media type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-mime',_binary 's:183:\"\"$1\" is a predefined property that describes the MIME type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-newp',_binary 's:181:\"\"$1\" is a predefined property that indicates whether a subject is new or not and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-num',_binary 's:189:\"\"$1\" is a [[Special:Types/Number|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent numeric values.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pdesc',_binary 's:194:\"\"$1\" is a predefined property that allows to describe a property in context of a language and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pefu',_binary 's:178:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to specify an external resource with a placeholder.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-peid',_binary 's:172:\"\"$1\" is a predefined property that specifies an external identifier and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-ppgr',_binary 's:229:\"\"$1\" is a predefined property that identifies entities (mainly categories) that are used as grouping instance for properties and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-prec',_binary 's:172:\"\"$1\" is a predefined property that describes a [https://www.semantic-mediawiki.org/wiki/Help:Display_precision display precision] (in decimal digits) for numeric datatypes.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pval',_binary 's:301:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value \"$1\"] is a predefined property that can define a list of permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pvali',_binary 's:330:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value_list \"$1\"] is a predefined property that can specify a reference to a list that holds permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pvap',_binary 's:292:\"\"$1\" is a predefined property that can specify a [[MediaWiki:Smw allows pattern|pattern reference]] to apply [https://en.wikipedia.org/wiki/Regular_expression regular expression] matching and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pvuc',_binary 's:205:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to restrict value assignments for each instance to be unique (or one at most).\";'),(_binary 'en',_binary 'messages:smw-property-predefined-qty',_binary 's:192:\"\"$1\" is a [[Special:Types/Quantity|type]] and predefined prop