Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-uri',_binary 's:186:\"\"$1\" is a [[Special:Types/URL|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent URI/URL values.\";'),(_binary 'en',_binary 'messages:smw-property-preferred-label-language-combination-exists',_binary 's:103:\"\"$1\" cannot be used as preferred label because the language \"$2\" is already assigned to the \"$3\" label.\";'),(_binary 'en',_binary 'messages:smw-property-preferred-title-format',_binary 's:7:\"$1 ($2)\";'),(_binary 'en',_binary 'messages:smw-property-req-violation-change-propagation-locked-error',_binary 's:506:\"Property \"$1\" was altered and requires assigned entities to be reevaluated using a [https://www.semantic-mediawiki.org/wiki/Change_propagation change propagation] process. The property page has been locked until the primary specification update is completed to prevent intermediary interruptions or contradictory specifications. The process may take moment before the page can be unlocked as it depends on the size and frequency of the [https://www.mediawiki.org/wiki/Manual:Job_queue job queue] scheduler.\";'),(_binary 'en',_binary 'messages:smw-property-req-violation-change-propagation-locked-warning',_binary 's:442:\"Property \"$1\" was altered and requires assigned entities to be reevaluated using a [https://www.semantic-mediawiki.org/wiki/Change_propagation change propagation] process. The update may take moment as it depends on the size and frequency of the [https://www.mediawiki.org/wiki/Manual:Job_queue job queue] scheduler and it is suggested to postpone changes to the property to prevent intermediary interruptions or contradictory specifications.\";'),(_binary 'en',_binary 'messages:smw-property-req-violation-change-propagation-pending',_binary 's:358:\"[https://www.semantic-mediawiki.org/wiki/Change_propagation Change propagati