query-condition-circular',_binary 's:56:\"A possible circular condition has been detected in \"$1\".\";'),(_binary 'en',_binary 'messages:smw-query-condition-empty',_binary 's:45:\"The query description has an empty condition.\";'),(_binary 'en',_binary 'messages:smw-query-reference-link-label',_binary 's:15:\"Query reference\";'),(_binary 'en',_binary 'messages:smw-redirect-target-unresolvable',_binary 's:48:\"The target is unresolvable on the reason of \"$1\"\";'),(_binary 'en',_binary 'messages:smw-remote-request-note',_binary 's:167:\"The result is fetched from the \'\'\'$1\'\'\' remote source and it is likely for generated content to contain information that is not available from within the current wiki.\";'),(_binary 'en',_binary 'messages:smw-remote-request-note-cached',_binary 's:172:\"The result is \'\'\'cached\'\'\' from the \'\'\'$1\'\'\' remote source and it is likely for generated content to contain information that is not available from within the current wiki.\";'),(_binary 'en',_binary 'messages:smw-remote-source-disabled',_binary 's:60:\"The \'\'\'$1\'\'\' source has disabled the remote request support!\";'),(_binary 'en',_binary 'messages:smw-remote-source-unavailable',_binary 's:44:\"Unable to connect to the remote \"$1\" target.\";'),(_binary 'en',_binary 'messages:smw-remote-source-unmatched-id',_binary 's:101:\"The \'\'\'$1\'\'\' source does not match a version of Semantic MediaWiki that can support a remote request.\";'),(_binary 'en',_binary 'messages:smw-schema-description-link-format-schema',_binary 's:178:\"This schema type is expected to define characteristics for creating context sensitive links in connection with a [[Property:Formatter schema|formatter schema]] assigned property.\";'),(_binary 'en',_binary 'messages:smw-schema-description-search-form-schema',_binary 's:313:\"This schema type is expected to be used to define input forms and characteristics for the [https://www.semantic-mediawiki.org/wiki/Help:SMWSearch extended search] profile where it contains instructions on how to generate input fields, define default namespaces, or declare prefix expressions for a search request.\";'),(_binary 'en',_binary 'messages:smw-schema-error',_binary 's:16:\"Validation error\";'),(_binary 'en',_binary 'messages:smw-schema-error-schema',_binary 's:129:\"\'\'\'$1\'\'\' specification and the validation thereof for the current schema has found the following incompatibilities or violations:\";'),(_binary 'en',_binary 'messages:smw-schema-error-type-missing',_binary 's:152:\"The content is missing a type in order for it to be recognized and usable in the [https://www.semantic-mediawiki.org/wiki/Help:Schema schema namespace].\";'),(_binary 'en',_binary 'messages:smw-schema-error-type-unknown',_binary 's:152:\"The \"$1\" type is not registered and can therefore not be used for content in the [https://www.semantic-mediawiki.org/wiki/Help:Schema schema namespace].\";'),(_binary 'en',_binary 'messages:smw-schema-error-violation',_binary 's:22:\"Violation (\"$1\", \"$2\")\";'),(_binary 'en',_binary 'messages:smw-schema-namespace-edit-protection',_binary 's:174:\"This page is protected and can only be edited by users with the appropriate <code>smw-schemaedit</code> [https://www.semantic-mediawiki.org/wiki/Help:Permissions permission].\";'),(_binary 'en',_binary 'messages:smw-schema-namespace-editcontentmodel-disallowed',_binary 's:115:\"Changing the content model of a [https://www.semantic-mediawiki.org/wiki/Help:Schema schema page] is not permitted.\";'),(_binary 'en',_binary 'messages:smw-schema-tag',_binary 's:22:\"{{PLURAL:$1|Tag|Tags}}\";'),(_binary 'en',_binary 'messages:smw-schema-title',_binary 's:6:\"Schema\";'),(_binary 'en',_binary 'messages:smw-schema-type',_binary 's:4:\"Type\";'),(_binary 'en',_binary 'messages:smw-schema-type-help-link',_binary 's:59:\"https://www.semantic-mediawiki.org/wiki/Help:Schema/Type/$1\";'),(_binary 'en',_binary 'messages:smw-search-help-ask',_binary 's:371:\"The following links will explain how to use the <code>#ask</code> syntax.\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Selecting_pages Selecting pages] describes how to selected pages and build conditions\n\n*[https://www.semantic-mediawiki.org/wiki/Help:Search_operators Search operators] lists available search operators including those for range and wildcard queries\";'),(_binary 'en',_binary 'messages:smw-search-help-input-assistance',_binary 's:356:\"[https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Input assistance] is provided for the input field and requires to use one of following prefixes:\n\n*<code>p:</code> to enable property suggestions (e.g. <code><nowiki>[[p:Has ...</nowiki></code>)\n\n*<code>c:</code> to enable category suggestions\n\n*<code>con:</code> to enable concept suggestions\";'),(_binary 'en',_binary 'messages:smw-search-help-intro',_binary 's:317:\"A <code><nowiki>[[ ... ]]</nowiki></code> input will signal to the input processor to use the Semantic MediaWiki search back-end. It should be noted that combining <code><nowiki>[[ ... ]]</nowiki></code> with an unstructured text search such as <code><nowiki>[[ ... ]] OR Lorem ipsum</nowiki></code> is not supported.\";'),(_binary 'en',_binary 'messages:smw-search-help-proximity',_binary 's:344:\"Proximity searches (a property being unknown, \'\'\'only\'\'\' available for those back-ends that provide a full-text search integration):\n\n*<code><nowiki>[[in:lorem ipsum]]</nowiki></code> (search in all documents for \"lorem\" and \"ipsum\" that have been indexed)\n\n* <code><nowiki>[[phrase:lorem ipsum]]</nowiki></code> (match \"lorem ipsum\" as phrase)\";'),(_binary 'en',_binary 'messages:smw-search-help-structured',_binary 's:365:\"Structured searches:\n\n*<code><nowiki>[[Category:Lorem ipsum]]</nowiki></code>, <code><nowiki>[[Has number::123]]</nowiki></code> (as [https://www.semantic-mediawiki.org/wiki/Help:Search#Filter_context filtered context])\n\n*<code><nowiki>[[Has text::~*lorem*]]</nowiki></code> (with a [https://www.semantic-mediawiki.org/wiki/Help:Search#Query_context query context])\";'),(_binary 'en',_binary 'messages:smw-search-hide',_binary 's:4:\"Hide\";'),(_binary 'en',_binary 'messages:smw-search-input',_binary 's:16:\"Input and search\";'),(_binary 'en',_binary 'messages:smw-search-input-assistance',_binary 's:165:\"The [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance input assistant] is also enabled to ease the pre-selection of available properties and categories.\";'),(_binary 'en',_binary 'messages:smw-search-profile',_binary 's:8:\"Extended\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-find-forms',_binary 's:15:\"available forms\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-form',_binary 's:213:\"Forms are provided (if maintained) to match specific use cases by exposing different property and value fields to narrow down the input process and make it easy for users to proceed with a search request. (see $1)\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-intro',_binary 's:209:\"The Special:Search [https://www.semantic-mediawiki.org/wiki/Help:SMWSearch/Extended_profile extended profile] provides access to search functions specific to Semantic MediaWiki and its supported query backend.\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-namespace',_binary 's:137:\"The namespace selection box will be hidden as soon as a form is selected but can be made visible with the help of the \"show/hide\" button.\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-query',_binary 's:47:\"Used <code><nowiki>$1</nowiki></code> as query.\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-query-link',_binary 's:22:\"(For more details $1).\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax',_binary 's:155:\"The search input field supports the use of the <code>#ask</code> syntax to define a Semantic MediaWiki specific search context. Useful expressions include:\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-note',_binary 's:116:\"\'\'Some of the listed operations are only useful in connection with an enabled full-text index or the ElasticStore.\'\'\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-prefix',_binary 's:66:\"* Additional custom prefixes are available and defined such as: $1\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-reserved',_binary 's:60:\"* Some expressions are reserved such as: <nowiki>$1</nowiki>\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-simplified-has',_binary 's:170:\"* <code>has:</code> to match any entity with a property \"...\" (e.g. <code>has:(Foo && Bar)</code> is equivalent to <code><nowiki>[[Foo::+]] && [[Bar::+]]</nowiki></code>)\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-simplified-in',_binary 's:258:\"* <code>in:</code> to find anything that contains \"...\" and is especially useful when the search context or properties involved are unknown (e.g. <code>in:(lorem && ipsum)</code> is equivalent to <code><nowiki>[[~~*lorem*]] && [[~~*ipsum*]]</nowiki></code>).\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-simplified-not',_binary 's:63:\"* <code>not:</code> to not match any entity that includes \"...\"\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-simplified-phrase',_binary 's:83:\"* <code>phrase:</code> to find anything that contains \"...\" in the exact same order\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-sort',_binary 's:59:\"Specifies a sorting preference for the result display with:\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-sort-best',_binary 's:156:\"* \"Best match\" will sort entities by [https:/