INSERT INTO `devtext` VALUES (1,_binary '<strong>MediaWiki has been installed.</strong>\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]',_binary 'utf-8'),(2,_binary 'http://www.w3.org/2004/02/skos/core#|[http://www.w3.org/TR/skos-reference/skos.rdf Simple Knowledge Organization System (SKOS)]\n altLabel|Type:Monolingual text\n broader|Type:Annotation URI\n broaderTransitive|Type:Annotation URI\n broadMatch|Type:Annotation URI\n changeNote|Type:Text\n closeMatch|Type:Annotation URI\n Collection|Class\n Concept|Class\n ConceptScheme|Class\n definition|Type:Text\n editorialNote|Type:Text\n exactMatch|Type:Annotation URI\n example|Type:Text\n hasTopConcept|Type:Page\n hiddenLabel|Type:String\n historyNote|Type:Text\n inScheme|Type:Page\n mappingRelation|Type:Page\n member|Type:Page\n memberList|Type:Page\n narrower|Type:Annotation URI\n narrowerTransitive|Type:Annotation URI\n narrowMatch|Type:Annotation URI\n notation|Type:Text\n note|Type:Text\n OrderedCollection|Class\n prefLabel|Type:String\n related|Type:Annotation URI\n relatedMatch|Type:Annotation URI\n scopeNote|Type:Text\n semanticRelation|Type:Page\n topConceptOf|Type:Page\n\n[[Category:Imported vocabulary]]',_binary 'utf-8'),(3,_binary 'http://xmlns.com/foaf/0.1/|[http://www.foaf-project.org/ Friend Of A Friend]\n name|Type:Text\n homepage|Type:URL\n mbox|Type:Email\n mbox_sha1sum|Type:Text\n depiction|Type:URL\n phone|Type:Text\n Person|Category\n Organization|Category\n knows|Type:Page\n member|Type:Page\n\n[[Category:Imported vocabulary]]',_binary 'utf-8'),(4,_binary 'http://www.w3.org/2002/07/owl#|[http://www.w3.org/2002/07/owl Web Ontology Language (OWL)]\n AllDifferent|Category\n allValuesFrom|Type:Page\n AnnotationProperty|Category\n backwardCompatibleWith|Type:Page\n cardinality|Type:Number\n Class|Category\n comment|Type:Page\n complementOf|Type:Page\n DataRange|Category\n DatatypeProperty|Category\n DeprecatedClass|Category\n DeprecatedProperty|Category\n differentFrom|Type:Page\n disjointWith|Type:Page\n distinctMembers|Type:Page\n equivalentClass|Type:Page\n equivalentProperty|Type:Page\n FunctionalProperty|Category\n hasValue|Type:Page\n imports|Type:Page\n incompatibleWith|Type:Page\n intersectionOf|Type:Page\n InverseFunctionalProperty|Category\n inverseOf|Type:Page\n isDefinedBy|Type:Page\n label|Type:Page\n maxCardinality|Type:Number\n minCardinality|Type:Number\n Nothing|Category\n ObjectProperty|Category\n oneOf|Type:Page\n onProperty|Type:Page\n Ontology|Category\n OntologyProperty|Category\n owl|Type:Page\n priorVersion|Type:Page\n Restriction|Category\n sameAs|Type:Page\n seeAlso|Type:Page\n someValuesFrom|Type:Page\n SymmetricProperty|Category\n Thing|Category\n TransitiveProperty|Category\n unionOf|Type:Page\n versionInfo|Type:Page\n\n[[Category:Imported vocabulary]]',_binary 'utf-8'),(5,_binary '* [[Imported from::foaf:knows]]\n* [[Property description::A person known by this person (indicating some level of reciprocated interaction between the parties).@en]]\n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:foaf:knows}}',_binary 'utf-8'),(6,_binary '* [[Imported from::foaf:name]]\n* [[Property description::A name for some thing or agent.@en]]\n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:foaf:name}}',_binary 'utf-8'),(7,_binary '* [[Imported from::foaf:homepage]]\n* [[Property description::URL of the homepage of something, which is a general web resource.@en]] \n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:foaf:homepage}}',_binary 'utf-8'),(8,_binary '* [[Imported from::owl:differentFrom]]\n* [[Property description::The property that determines that two given individuals are different.@en]]\n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:owl:differentFrom}}',_binary 'utf-8'),(9,_binary '-- This module provides easy processing of arguments passed to Scribunto from\n-- #invoke. It is intended for use by other Lua modules, and should not be\n-- called from #invoke directly.\n\nlocal libraryUtil = require(\'libraryUtil\')\nlocal checkType = libraryUtil.checkType\n\nlocal arguments = {}\n\n-- Generate four different tidyVal functions, so that we don\'t have to check the\n-- options every time we call it.\n\nlocal function tidyValDefault(key, val)\n	if type(val) == \'string\' then\n		val = val:match(\'^%s*(.-)%s*$\')\n		if val == \'\' then\n			return nil\n		else\n			return val\n		end\n	else\n		return val\n	end\nend\n\nlocal function tidyValTrimOnly(key, val)\n	if type(val) == \'string\' then\n		return val:match(\'^%s*(.-)%s*$\')\n	else\n		return val\n	end\nend\n\nlocal function tidyValRemoveBlanksOnly(key, val)\n	if type(val) == \'string\' then\n		if val:find(\'%S\') then\n			return val\n		else\n			return nil\n		end\n	else\n		return val\n	end\nend\n\nlocal function tidyValNoChange(key, val)\n	return val\nend\n\nlocal function matchesTitle(given, title)\n	local tp = type( given )\n	return (tp == \'string\' or tp == \'number\') and mw.title.new( given ).prefixedText == title\nend\n\nlocal translate_mt = { __index = function(t, k) return k end }\n\nfunction arguments.getArgs(frame, options)\n	checkType(\'getArgs\', 1, frame, \'table\', true)\n	checkType(\'getArgs\', 2, options, \'table\', true)\n	frame = frame or {}\n	options = options or {}\n\n	--[[\n	-- Set up argument translation.\n	--]]\n	options.translate = options.translate or {}\n	if getmetatable(options.translate) == nil then\n		setmetatable(options.translate, translate_mt)\n	end\n	if options.backtranslate == nil then\n		options.backtranslate = {}\n		for k,v in pairs(options.translate) do\n			options.backtranslate[v] = k\n		end\n	end\n	if options.backtranslate and getmetatable(options.backtranslate) == nil then\n		setmetatable(options.backtranslate, {\n			__index = function(t, k)\n				if options.translate[k] ~= k then\n					return nil\n				else\n					return k\n				end\n			end\n		})\n	end\n\n	--[[\n	-- Get the argument tables. If we were passed a valid frame object, get the\n	-- frame arguments (fargs) and the parent frame arguments (pargs), depending\n	-- on the options set and on the parent frame\'s availability. If we weren\'t\n	-- passed a valid frame object, we are being called from another Lua module\n	-- or from the debug console, so assume that we were passed a table of args\n	-- directly, and assign it to a new variable (luaArgs).\n	--]]\n	local fargs, pargs, luaArgs\n	if type(frame.args) == \'table\' and type(frame.getParent) == \'function\' then\n		if options.wrappers then\n			--[[\n			-- The wrappers option makes Module:Arguments look up arguments in\n			-- either the frame argument table or the parent argument table, but\n			-- not both. This means that users can use either the #invoke syntax\n			-- or a wrapper template without the loss of performance associated\n			-- with looking arguments up in both the frame and the parent frame.\n			-- Module:Arguments will look up arguments in the parent frame\n			-- if it finds the parent frame\'s title in options.wrapper;\n			-- otherwise it will look up arguments in the frame object passed\n			-- to getArgs.\n			--]]\n			local parent = frame:getParent()\n			if not parent then\n				fargs = frame.args\n			else\n				local title = parent:getTitle():gsub(\'/sandbox$\', \'\')\n				local found = false\n				if matchesTitle(options.wrappers, title) then\n					found = true\n				elseif type(options.wrappers) == \'table\' then\n					for _,v in pairs(options.wrappers) do\n						if matchesTitle(v, title) then\n							found = true\n							break\n						end\n					end\n				end\n\n				-- We test for false specifically here so that nil (the default) acts like true.\n				if found or options.frameOnly == false then\n					pargs = parent.args\n				end\n				if not found or options.parentOnly == false then\n					fargs = frame.args\n				end\n			end\n		else\n			-- options.wrapper isn\'t set, so check the other options.\n			if not options.parentOnly then\n				fargs = frame.args\n			end\n			if not options.frameOnly then\n				local parent = frame:getParent()\n				pargs = parent and parent.args or nil\n			end\n		end\n		if options.parentFirst then\n			fargs, pargs = pargs, fargs\n		end\n	else\n		luaArgs = frame\n	end\n\n	-- Set the order of precedence of the argument tables. If the variables are\n	-- nil, nothing will be added to the table, which is how we avoid clashes\n	-- between the frame/parent args and the Lua args.\n	local argTables = {fargs}\n	argTables[#argTables + 1] = pargs\n	argTables[#argTables + 1] = luaArgs\n\n	--[[\n	-- Generate the tidyVal function. If it has been specified by the user, we\n	-- use that; if not, we choose one of four functions depending on the\n	-- options chosen. This is so that we don\'t have to call the options table\n	-- every time the function is called.\n	--]]\n	local tidyVal = options.valueFunc\n	if tidyVal then\n		if type(tidyVal) ~= \'function\' then\n			error(\n				\"bad value assigned to option \'valueFunc\'\"\n					.. \'(function expected, got \'\n					.. type(tidyVal)\n					.. \')\',\n				2\n			)\n		end\n	elseif options.trim ~= false then\n		if options.removeBlanks ~= false then\n			tidyVal = tidyValDefault\n		else\n			tidyVal = tidyValTrimOnly\n		end\n	else\n		if options.removeBlanks ~= false then\n			tidyVal = tidyValRemoveBlanksOnly\n		else\n			tidyVal = tidyValNoChange\n		end\n	end\n\n	--[[\n	-- Set up the args, metaArgs and nilArgs tables. args will be