	elseif type(k) ~= \'string\' or not options.backtranslate then\n			return k, v\n		else\n			local backtranslate = options.backtranslate[k]\n			if backtranslate == nil then\n				-- Skip this one. This is a tail call, so this won\'t cause stack overflow\n				return translatenext(invariant)\n			else\n				return backtranslate, v\n			end\n		end\n	end\n\n	metatable.__pairs = function ()\n		-- Called when pairs is run on the args table.\n		if not metatable.donePairs then\n			mergeArgs(argTables)\n			metatable.donePairs = true\n		end\n		return translatenext, { t = metaArgs }\n	end\n\n	local function inext(t, i)\n		-- This uses our __index metamethod\n		local v = t[i + 1]\n		if v ~= nil then\n			return i + 1, v\n		end\n	end\n\n	metatable.__ipairs = function (t)\n		-- Called when ipairs is run on the args table.\n		return inext, t, 0\n	end\n\n	return args\nend\n\nreturn arguments',_binary 'utf-8'),(10,_binary '--------------------------------------------------------------------------------\n--                                                                            --\n--                              CATEGORY HANDLER                              --\n--                                                                            --\n--      This module implements the {{category handler}} template in Lua,      --\n--      with a few improvements: all namespaces and all namespace aliases     --\n--      are supported, and namespace names are detected automatically for     --\n--      the local wiki. This module requires [[Module:Namespace detect]]      --\n--      and [[Module:Yesno]] to be available on the local wiki. It can be     --\n--      configured for different wikis by altering the values in              --\n--      [[Module:Category handler/config]], and pages can be blacklisted      --\n--      from categorisation by using [[Module:Category handler/blacklist]].   --\n--                                                                            --\n--------------------------------------------------------------------------------\n\n-- Load required modules\nlocal yesno = require(\'Module:Yesno\')\n\n-- Lazily load things we don\'t always need\nlocal mShared, mappings\n\nlocal p = {}\n\n--------------------------------------------------------------------------------\n-- Helper functions\n--------------------------------------------------------------------------------\n\nlocal function trimWhitespace(s, removeBlanks)\n	if type(s) ~= \'string\' then\n		return s\n	end\n	s = s:match(\'^%s*(.-)%s*$\')\n	if removeBlanks then\n		if s ~= \'\' then\n			return s\n		else\n			return nil\n		end\n	else\n		return s\n	end\nend\n\n--------------------------------------------------------------------------------\n-- CategoryHandler class\n--------------------------------------------------------------------------------\n\nlocal CategoryHandler = {}\nCategoryHandler.__index = CategoryHandler\n\nfunction CategoryHandler.new(data, args)\n	local obj = setmetatable({ _data = data, _args = args }, CategoryHandler)\n	\n	-- Set the title object\n	do\n		local pagename = obj:parameter(\'demopage\')\n		local success, titleObj\n		if pagename then\n			success, titleObj = pcall(mw.title.new, pagename)\n		end\n		if success and titleObj then\n			obj.title = titleObj\n			if titleObj == mw.title.getCurrentTitle() then\n				obj._usesCurrentTitle = true\n			end\n		else\n			obj.title = mw.title.getCurrentTitle()\n			obj._usesCurrentTitle = true\n		end\n	end\n\n	-- Set suppression parameter values\n	for _, key in ipairs{\'nocat\', \'categories\'} do\n		local value = obj:parameter(key)\n		value = trimWhitespace(value, true)\n		obj[\'_\' .. key] = yesno(value)\n	end\n	do\n		local subpage = obj:parameter(\'subpage\')\n		local category2 = obj:parameter(\'category2\')\n		if type(subpage) == \'string\' then\n			subpage = mw.ustring.lower(subpage)\n		end\n		if type(category2) == \'string\' then\n			subpage = mw.ustring.lower(category2)\n		end\n		obj._subpage = trimWhitespace(subpage, true)\n		obj._category2 = trimWhitespace(category2) -- don\'t remove blank values\n	end\n	return obj\nend\n\nfunction CategoryHandler:parameter(key)\n	local parameterNames = self._data.parameters[key]\n	local pntype = type(parameterNames)\n	if pntype == \'string\' or pntype == \'number\' then\n		return self._args[parameterNames]\n	elseif pntype == \'table\' then\n		for _, name in ipairs(parameterNames) do\n			local value = self._args[name]\n			if value ~= nil then\n				return value\n			end\n		end\n		return nil\n	else\n		error(string.format(\n			\'invalid config key \"%s\"\',\n			tostring(key)\n		), 2)\n	end\nend\n\nfunction CategoryHandler:isSuppressedByArguments()\n	return\n		-- See if a category suppression argument has been set.\n		self._nocat == true\n		or self._categories == false\n		or (\n			self._category2\n			and self._category2 ~= self._data.category2Yes\n			and self._category2 ~= self._data.category2Negative\n		)\n\n		-- Check whether we are on a subpage, and see if categories are\n		-- suppressed based on our subpage status.\n		or self._subpage == self._data.subpageNo and self.title.isSubpage\n		or self._subpage == self._data.subpageOnly and not self.title.isSubpage\nend\n\nfunction CategoryHandler:shouldSkipBlacklistCheck()\n	-- Check whether the category suppression arguments indicate we\n	-- should skip the blacklist check.\n	return self._nocat == false\n		or self._categories == true\n		or self._category2 == self._data.category2Yes\nend\n\nfunction CategoryHandler:matchesBlacklist()\n	if self._usesCurrentTitle then\n		return self._data.currentTitleMatchesBlacklist\n	else\n		mShared = mShared or require(\'Module:Category handler/shared\')\n		return mShared.matchesBlacklist(\n			self.title.prefixedText,\n			mw.loadData(\'Module:Category handler/blacklist\')\n		)\n	end\nend\n\nfunction CategoryHandler:isSuppressed()\n	-- Find if categories are suppressed by either the arguments or by\n	-- matching the blacklist.\n	return self:isSuppressedByArguments()\n		or not self:shouldSkipBlacklistCheck() and self:matchesBlacklist()\nend\n\nfunction CategoryHandler:getNamespaceParameters()\n	if self._usesCurrentTitle then\n		return self._data.currentTitleNamespaceParameters\n	else\n		if not mappings then\n			mShared = mShared or require(\'Module:Category handler/shared\')\n			mappings = mShared.getParamMappings(true) -- gets mappings with mw.loadData\n		end\n		return mShared.getNamespaceParameters(\n			self.title,\n			mappings\n		)\n	end\nend\n\nfunction CategoryHandler:namespaceParametersExist()\n	-- Find whether any namespace parameters have been specified.\n	-- We use the order \"all\" --> namespace params --> \"other\" as this is what\n	-- the old template did.\n	if self:parameter(\'all\') then\n		return true\n	end\n	if not mappings then\n		mShared = mShared or require(\'Module:Category handler/shared\')\n		mappings = mShared.getParamMappings(true) -- gets mappings with mw.loadData\n	end\n	for ns, params in pairs(mappings) do\n		for i, param in ipairs(params) do\n			if self._args[param] then\n				return true\n			end\n		end\n	end\n	if self:parameter(\'other\') then\n		return true\n	end\n	return false\nend\n\nfunction CategoryHandler:getCategories()\n	local params = self:getNamespaceParameters()\n	local nsCategory\n	for i, param in ipairs(params) do\n		local value = self._args[param]\n		if value ~= nil then\n			nsCategory = value\n			break\n		end\n	end\n	if nsCategory ~= nil or self:namespaceParametersExist() then\n		-- Namespace parameters exist - advanced usage.\n		if nsCategory == nil then\n			nsCategory = self:parameter(\'other\')\n		end\n		local ret = {self:parameter(\'all\')}\n		local numParam = tonumber(nsCategory)\n		if numParam and numParam >= 1 and math.floor(numParam) == numParam then\n			-- nsCategory is an integer\n			ret[#ret + 1] = self._args[numParam]\n		else\n			ret[#ret + 1] = nsCategory\n		end\n		if #ret < 1 then\n			return nil\n		else\n			return table.concat(ret)\n		end\n	elseif self._data.defaultNamespaces[self.title.namespace] then\n		-- Namespace parameters don\'t exist, simple usage.\n		return self._args[1]\n	end\n	return nil\nend\n\n--------------------------------------------------------------------------------\n-- Exports\n--------------------------------------------------------------------------------\n\nlocal p = {}\n\nfunction p._exportClasses()\n	-- Used for testing purposes.\n	return {\n		CategoryHandler = CategoryHandler\n	}\nend\n\nfunction p._main(args, data)\n	data = data or mw.loadData(\'Module:Category handler/data\')\n	local handler = CategoryHandler.new(data, args)\n	if handler:isSuppressed() then\n		return nil\n	end\n	return handler:getCategories()\nend\n\nfunction p.main(frame, data)\n	data = data or mw.loadData(\'Module:Category handler/data\')\n	local args = require(\'Module:Arguments\').getArgs(frame, {\n		wrappers = data.wrappers,\n		valueFunc = function (k, v)\n			v = trimWhitespace(v)\n			if type(k) == \'number\' then\n				if v ~= \'\' then\n					return v\n				else\n					return nil\n				end\n			else\n				return v\n			end\n		end\n	})\n	return p._main(args, data)\nend\n\nreturn p',_binary 'utf-8'),(11,_binary '-- This module contains the blacklist used by [[Module:Category handler]].\n-- Pages that match Lua patterns in this list will not be categorised unless\n-- categorisation is explicitly requested.\n\nreturn {\n    \'^Main Page$\', -- don\'t categorise the main page.\n \n    -- Don\'t categorise the following pages or their subpages.\n    -- \"%f[/\\0]\" matches if the next character is \"/\" or the end of the string.\n    \'^Wikipedia:Cascade%-protected items%f[/\\0]\',\n    \'^User:UBX%f[/\\0]\', -- The userbox \"template\" space.\n    \'^User talk:UBX%f[/\\0]\',\n \n    -- Don\'t categorise subpages of these pages, but allow\n    -- categorisation of the base page.\n    \'^Wikipedia:Template messages/.*$\',\n \n    \'/[aA]rchive\' -- Don\'t categorise archives.\n}',_binary 'utf-8'),(12,_binary '--------------------------------------------------------------------------------\n--            [[Module:Category handler]] configuration data                  --\n--       Language-specific parameter names and values can be set here.        --\n--       For blacklist config, see [[Module:Category handler/blacklist]].     --\n--------------------------------------------------------------------------------\n\nlocal cfg = {} -- Don\'t edit this line.\n\n--------------------------------------------------------------------------------\n--                       Start configuration data                             --\n--------------------------------------------------------------------------------\n\n--------------------------------------------------------------------------------\n--                              Parameter names                               --\n-- These configuration items specify custom parameter names.                  --\n-- To add one extra name, you can use this format:                            --\n--                                                                            --\n-- foo = \'parameter name\',                                                    --\n--                                                                            --\n-- To add multiple names, you can use this format:                            --\n--                                                                            --\n-- foo = {\'parameter name 1\', \'parameter name 2\', \'parameter name 3\'},        --\n--------------------------------------------------------------------------------\n\ncfg.parameters = {\n	\n	-- The nocat and categories parameter suppress\n	-- categorisation. They are used with Module:Yesno, and work as follows:\n	--\n	-- cfg.nocat:\n	-- Result of yesno()                        Effect\n	-- true                                     Categorisation is suppressed\n	-- false                                    Categorisation is allowed, and\n	--                                          the blacklist check is skipped\n	-- nil                                      Categorisation is allowed\n	--\n	-- cfg.categories:\n	-- Result of yesno()                        Effect\n	-- true                                     Categorisation is allowed, and\n	--                                          the blacklist check is skipped\n	-- false                                    Categorisation is suppressed\n	-- nil                                      Categorisation is allowed\n	nocat = \'nocat\',\n	categories = \'categories\',\n	\n	-- The parameter name for the legacy \"category2\" parameter. This skips the\n	-- blacklist if set to the cfg.category2Yes value, and suppresses\n	-- categorisation if present but equal to anything other than\n	-- cfg.category2Yes or cfg.category2Negative.\n	category2 = \'category2\',\n	\n	-- cfg.subpage is the parameter name to specify how to behave on subpages.\n	subpage = \'subpage\',\n	\n	-- The parameter for data to return in all namespaces.\n	all = \'all\',\n	\n	-- The parameter name for data to return if no data is specified for the\n	-- namespace that is detected.\n	other = \'other\',\n	\n	-- The parameter name used to specify a page other than the current page;\n	-- used for testing and demonstration.\n	demopage = \'page\',\n}\n\n--------------------------------------------------------------------------------\n--                              Parameter values                              --\n-- These are set values that can be used with certain parameters. Only one    --\n-- value can be specified, like this:                                         --\n--                                                                            --\n-- cfg.foo = \'value name\'                                                     --                                               --\n--------------------------------------------------------------------------------\n\n-- The following settings are used with the cfg.category2 parameter. Setting\n-- cfg.category2 to cfg.category2Yes skips the blacklist, and if cfg.category2\n-- is present but equal to anything other than cfg.category2Yes or\n-- cfg.category2Negative then it supresses cateogrisation.\ncfg.category2Yes = \'yes\'\ncfg.category2Negative = \'¬\'\n\n-- The following settings are used with the cfg.subpage parameter.\n-- cfg.subpageNo is the value to specify to not categorise on subpages;\n-- cfg.subpageOnly is the value to specify to only categorise on subpages.\ncfg.subpageNo = \'no\'\ncfg.subpageOnly = \'only\'\n\n--------------------------------------------------------------------------------\n--                           Default namespaces                               --\n-- This is a table of namespaces to categorise by default. The keys are the   --\n-- namespace numbers.                                                         --\n--------------------------------------------------------------------------------\n\ncfg.defaultNamespaces = {\n	[  0] = true, -- main\n	[  6] = true, -- file\n	[ 12] = true, -- help\n	[ 14] = true, -- category\n	[100] = true, -- portal\n	[108] = true, -- book\n}\n\n--------------------------------------------------------------------------------\n--                                Wrappers                                    --\n-- This is a wrapper template or a list of wrapper templates to be passed to  --\n-- [[Module:Arguments]].                                                      --\n--------------------------------------------------------------------------------\n\ncfg.wrappers = \'Template:Category handler\'\n\n--------------------------------------------------------------------------------\n--                           End configuration data                           --\n--------------------------------------------------------------------------------\n\nreturn cfg -- Don\'t edit this line.',_binary 'utf-8'),(13,_binary '-- This module assembles data to be passed to [[Module:Category handler]] using\n-- mw.loadData. This includes the configuration data and whether the current\n-- page matches the title blacklist.\n\nlocal data = require(\'Module:Category handler/config\')\nlocal mShared = require(\'Module:Category handler/shared\')\nlocal blacklist = require(\'Module:Category handler/blacklist\')\nlocal title = mw.title.getCurrentTitle()\n\ndata.currentTitleMatchesBlacklist = mShared.matchesBlacklist(\n	title.prefixedText,\n	blacklist\n)\n\ndata.currentTitleNamespaceParameters = mShared.getNamespaceParameters(\n	title,\n	mShared.getParamMappings()\n)\n\nreturn data',_binary 'utf-8'),(14,_binary '-- This module contains shared functions used by [[Module:Category handler]]\n-- and its submodules.\n\nlocal p = {}\n\nfunction p.matchesBlacklist(page, blacklist)\n	for i, pattern in ipairs(blacklist) do\n		local match = mw.ustring.match(page, pattern)\n		if match then\n			return true\n		end\n	end\n	return false\nend\n\nfunction p.getParamMappings(useLoadData)\n	local dataPage = \'Module:Namespace detect/data\'\n	if useLoadData then\n		return mw.loadData(dataPage).mappings\n	else\n		return require(dataPage).mappings\n	end\nend\n\nfunction p.getNamespaceParameters(titleObj, mappings)\n	-- We don\'t use title.nsText for the namespace name because it adds\n	-- underscores.\n	local mappingsKey\n	if titleObj.isTalkPage then\n		mappingsKey = \'talk\'\n	else\n		mappingsKey = mw.site.namespaces[titleObj.namespace].name\n	end\n	mappingsKey = mw.ustring.lower(mappingsKey)\n	return mappings[mappingsKey] or {}\nend\n\nreturn p',_binary 'utf-8'),(15,_binary '-- This module implements {{documentation}}.\n\n-- Get required modules.\nlocal getArgs = require(\'Module:Arguments\').getArgs\nlocal messageBox = require(\'Module:Message box\')\n\n-- Get the config table.\nlocal cfg = mw.loadData(\'Module:Documentation/config\')\n\nlocal p = {}\n\n-- Often-used functions.\nlocal ugsub = mw.ustring.gsub\n\n----------------------------------------------------------------------------\n-- Helper functions\n--\n-- These are defined as local functions, but are made available in the p\n-- table for testing purposes.\n----------------------------------------------------------------------------\n\nlocal function message(cfgKey, valArray, expectType)\n	--[[\n	-- Gets a message from the cfg table and formats it if appropriate.\n	-- The function raises an error if the value from the cfg table is not\n	-- of the type expectType. The default type for expectType is \'string\'.\n	-- If the table valArray is present, strings such as $1, $2 etc. in the\n	-- message are substituted with values from the table keys [1], [2] etc.\n	-- For example, if the message \"foo-message\" had the value \'Foo $2 bar $1.\',\n	-- message(\'foo-message\', {\'baz\', \'qux\'}) would return \"Foo qux bar baz.\"\n	--]]\n	local msg = cfg[cfgKey]\n	expectType = expectType or \'string\'\n	if type(msg) ~= expectType then\n		error(\'message: type error in message cfg.\' .. cfgKey .. \' (\' .. expectType .. \' expected, got \' .. type(msg) .. \')\', 2)\n	end\n	if not valArray then\n		return msg\n	end\n\n	local function getMessageVal(match)\n		match = tonumber(match)\n		return valArray[match] or error(\'message: no value found for key $\' .. match .. \' in message cfg.\' .. cfgKey, 4)\n	end\n\n	local ret = ugsub(msg, \'$([1-9][0-9]*)\', getMessageVal)\n	return ret\nend\n\np.message = message\n\nlocal function makeWikilink(page, display)\n	if display then\n		return mw.ustring.format(\'[[%s|%s]]\', page, display)\n	else\n		return mw.ustring.format(\'[[%s]]\', page)\n	end\nend\n\np.makeWikilink = makeWikilink\n\nlocal function makeCategoryLink(cat, sort)\n	local catns = mw.site.namespaces[14].name\n	return makeWikilink(catns .. \':\' .. cat, sort)\nend\n\np.makeCategoryLink = makeCategoryLink\n\nlocal function makeUrlLink(url, display)\n	return mw.ustring.format(\'[%s %s]\', url, display)\nend\n\np.makeUrlLink = makeUrlLink\n\nlocal function makeToolbar(...)\n	local ret = {}\n	local lim = select(\'#\', ...)\n	if lim < 1 then\n		return nil\n	end\n	for i = 1, lim do\n		ret[#ret + 1] = select(i, ...)\n	end\n	return \'<small style=\"font-style: normal;\">(\' .. table.concat(ret, \' &#124; \') .. \')</small>\'\nend	\n\np.makeToolbar = makeToolbar\n\n----------------------------------------------------------------------------\n-- Argument processing\n----------------------------------------------------------------------------\n\nlocal function makeInvokeFunc(funcName)\n	return function (frame)\n		local args = getArgs(frame, {\n			valueFunc = function (key, value)\n				if type(value) == \'string\' then\n					value = value:match(\'^%s*(.-)%s*$\') -- Remove whitespace.\n					if key == \'heading\' or value ~= \'\' then\n						return value\n					else\n						return nil\n					end\n				else\n					return value\n				end\n			end\n		})\n		return p[funcName](args)\n	end\nend\n\n----------------------------------------------------------------------------\n-- Main function\n----------------------------------------------------------------------------\n\np.main = makeInvokeFunc(\'_main\')\n\nfunction p._main(args)\n	--[[\n	-- This function defines logic flow for the module.\n	-- @args - table of arguments passed by the user\n	-- \n	-- Messages:\n	-- \'main-div-id\' --> \'template-documentation\'\n	-- \'main-div-classes\' --> \'template-documentation iezoomfix\'\n	--]]\n	local env = p.getEnvironment(args)\n	local root = mw.html.create()\n	root\n		:wikitext(p.protectionTemplate(env))\n		:wikitext(p.sandboxNotice(args, env))\n		 -- This div tag is from {{documentation/start box}}, but moving it here\n		 -- so that we don\'t have to worry about unclosed tags.\n		:tag(\'div\')\n			:attr(\'id\', message(\'main-div-id\'))\n			:addClass(message(\'main-div-classes\'))\n			:css(\'padding\', \'12px\')\n			:newline()\n			:wikitext(p._startBox(args, env))\n			:wikitext(p._content(args, env))\n			:tag(\'div\')\n				:css(\'clear\', \'both\') -- So right or left floating items don\'t stick out of the doc box.\n				:newline()\n				:done()\n			:done()\n		:wikitext(p._endBox(args, env))\n		:wikitext(p.addTrackingCategories(env))\n	return tostring(root)\nend\n\n----------------------------------------------------------------------------\n-- Environment settings\n----------------------------------------------------------------------------\n\nfunction p.getEnvironment(args)\n	--[[\n	-- Returns a table with information about the environment, including title objects and other namespace- or\n	-- path-related data.\n	-- @args - table of arguments passed by the user\n	--\n	-- Title objects include:\n	-- env.title - the page we are making documentation for (usually the current title)\n	-- env.templateTitle - the template (or module, file, etc.)\n	-- env.docTitle - the /doc subpage.\n	-- env.sandboxTitle - the /sandbox subpage.\n	-- env.testcasesTitle - the /testcases subpage.\n	-- env.printTitle - the print version of the template, located at the /Print subpage.\n	--\n	-- Data includes:\n	-- env.protectionLevels - the protection levels table of the title object.\n	-- env.subjectSpace - the number of the title\'s subject namespace.\n	-- env.docSpace - the number of the namespace the title puts its documentation in.\n	-- env.docpageBase - the text of the base page of the /doc, /sandbox and /testcases pages, with namespace.\n	-- env.compareUrl - URL of the Special:ComparePages page comparing the sandbox with the template.\n	-- \n	-- All table lookups are passed through pcall so that errors are caught. If an error occurs, the value\n	-- returned will be nil.\n	--]]\n	\n	local env, envFuncs = {}, {}\n\n	-- Set up the metatable. If triggered we call the corresponding function in the envFuncs table. The value\n	-- returned by that function is memoized in the env table so that we don\'t call any of the functions\n	-- more than once. (Nils won\'t be memoized.)\n	setmetatable(env, {\n		__index = function (t, key)\n			local envFunc = envFuncs[key]\n			if envFunc then\n				local success, val = pcall(envFunc)\n				if success then\n					env[key] = val -- Memoise the value.\n					return val\n				end\n			end\n			return nil\n		end\n	})	\n\n	function envFuncs.title()\n		-- The title object for the current page, or a test page passed with args.page.\n		local title\n		local titleArg = args.page\n		if titleArg then\n			title = mw.title.new(titleArg)\n		else\n			title = mw.title.getCurrentTitle()\n		end\n		return title\n	end\n\n	function envFuncs.templateTitle()\n		--[[\n		-- The template (or module, etc.) title object.\n		-- Messages:\n		-- \'sandbox-subpage\' --> \'sandbox\'\n		-- \'testcases-subpage\' --> \'testcases\'\n		--]]\n		local subjectSpace = env.subjectSpace\n		local title = env.title\n		local subpage = title.subpageText\n		if subpage == message(\'sandbox-subpage\') or subpage == message(\'testcases-subpage\') then\n			return mw.title.makeTitle(subjectSpace, title.baseText)\n		else\n			return mw.title.makeTitle(subjectSpace, title.text)\n		end\n	end\n\n	function envFuncs.docTitle()\n		--[[\n		-- Title object of the /doc subpage.\n		-- Messages:\n		-- \'doc-subpage\' --> \'doc\'\n		--]]\n		local title = env.title\n		local docname = args[1] -- User-specified doc page.\n		local docpage\n		if docname then\n			docpage = docname\n		else\n			docpage = env.docpageBase .. \'/\' .. message(\'doc-subpage\')\n		end\n		return mw.title.new(docpage)\n	end\n	\n	function envFuncs.sandboxTitle()\n		--[[\n		-- Title object for the /sandbox subpage.\n		-- Messages:\n		-- \'sandbox-subpage\' --> \'sandbox\'\n		--]]\n		return mw.title.new(env.docpageBase .. \'/\' .. message(\'sandbox-subpage\'))\n	end\n	\n	function envFuncs.testcasesTitle()\n		--[[\n		-- Title object for the /testcases subpage.\n		-- Messages:\n		-- \'testcases-subpage\' --> \'testcases\'\n		--]]\n		return mw.title.new(env.docpageBase .. \'/\' .. message(\'testcases-subpage\'))\n	end\n	\n	function envFuncs.printTitle()\n		--[[\n		-- Title object for the /Print subpage.\n		-- Messages:\n		-- \'print-subpage\' --> \'Print\'\n		--]]\n		return env.templateTitle:subPageTitle(message(\'print-subpage\'))\n	end\n\n	function envFuncs.protectionLevels()\n		-- The protection levels table of the title object.\n		return env.title.protectionLevels\n	end\n\n	function envFuncs.subjectSpace()\n		-- The subject namespace number.\n		return mw.site.namespaces[env.title.namespace].subject.id\n	end\n\n	function envFuncs.docSpace()\n		-- The documentation namespace number. For most namespaces this is the same as the\n		-- subject namespace. However, pages in the Article, File, MediaWiki or Category\n		-- namespaces must have their /doc, /sandbox and /testcases pages in talk space.\n		local subjectSpace = env.subjectSpace\n		if subjectSpace == 0 or subjectSpace == 6 or subjectSpace == 8 or subjectSpace == 14 then\n			return subjectSpace + 1\n		else\n			return subjectSpace\n		end\n	end\n\n	function envFuncs.docpageBase()\n		-- The base page of the /doc, /sandbox, and /testcases subpages.\n		-- For some namespaces this is the talk page, rather than the template page.\n		local templateTitle = env.templateTitle\n		local docSpace = env.docSpace\n		local docSpaceText = mw.site.namespaces[docSpace].name\n		-- Assemble the link. docSpace is never the main namespace, so we can hardcode the colon.\n		return docSpaceText .. \':\' .. templateTitle.text\n	end\n	\n	function envFuncs.compareUrl()\n		-- Diff link between the sandbox and the main template using [[Special:ComparePages]].\n		local templateTitle = env.templateTitle\n		local sandboxTitle = env.sandboxTitle\n		if templateTitle.exists and sandboxTitle.exists then\n			local compareUrl = mw.uri.fullUrl(\n				\'Special:ComparePages\',\n				{page1 = templateTitle.prefixedText, page2 = sandboxTitle.prefixedText}\n			)\n			return tostring(compareUrl)\n		else\n			return nil\n		end\n	end		\n\n	return env\nend	\n\n----------------------------------------------------------------------------\n-- Auxiliary templates\n----------------------------------------------------------------------------\n\nfunction p.sandboxNotice(args, env)\n	--[=[\n	-- Generates a sandbox notice for display above sandbox pages.\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- \n	-- Messages:\n	-- \'sandbox-notice-image\' --> \'[[Image:Sandbox.svg|50px|alt=|link=]]\'\n	-- \'sandbox-notice-blurb\' --> \'This is the $1 for $2.\'\n	-- \'sandbox-notice-diff-blurb\' --> \'This is the $1 for $2 ($3).\'\n	-- \'sandbox-notice-pagetype-template\' --> \'[[Wikipedia:Template test cases|template sandbox]] page\'\n	-- \'sandbox-notice-pagetype-module\' --> \'[[Wikipedia:Template test cases|module sandbox]] page\'\n	-- \'sandbox-notice-pagetype-other\' --> \'sandbox page\'\n	-- \'sandbox-notice-compare-link-display\' --> \'diff\'\n	-- \'sandbox-notice-testcases-blurb\' --> \'See also the companion subpage for $1.\'\n	-- \'sandbox-notice-testcases-link-display\' --> \'test cases\'\n	-- \'sandbox-category\' --> \'Template sandboxes\'\n	--]=]\n	local title = env.title\n	local sandboxTitle = env.sandboxTitle\n	local templateTitle = env.templateTitle\n	local subjectSpace = env.subjectSpace\n	if not (subjectSpace and title and sandboxTitle and templateTitle and mw.title.equals(title, sandboxTitle)) then\n		return nil\n	end\n	-- Build the table of arguments to pass to {{ombox}}. We need just two fields, \"image\" and \"text\".\n	local omargs = {}\n	omargs.image = message(\'sandbox-notice-image\')\n	-- Get the text. We start with the opening blurb, which is something like\n	-- \"This is the template sandbox for [[Template:Foo]] (diff).\"\n	local text = \'\'\n	local frame = mw.getCurrentFrame()\n	local isPreviewing = frame:preprocess(\'{{REVISIONID}}\') == \'\' -- True if the page is being previewed.\n	local pagetype\n	if subjectSpace == 10 then\n		pagetype = message(\'sandbox-notice-pagetype-template\')\n	elseif subjectSpace == 828 then\n		pagetype = message(\'sandbox-notice-pagetype-module\')\n	else\n		pagetype = message(\'sandbox-notice-pagetype-other\')\n	end\n	local templateLink = makeWikilink(templateTitle.prefixedText)\n	local compareUrl = env.compareUrl\n	if isPreviewing or not compareUrl then\n		text = text .. message(\'sandbox-notice-blurb\', {pagetype, templateLink})\n	else\n		local compareDisplay = message(\'sandbox-notice-compare-link-display\')\n		local compareLink = makeUrlLink(compareUrl, compareDisplay)\n		text = text .. message(\'sandbox-notice-diff-blurb\', {pagetype, templateLink, compareLink})\n	end\n	-- Get the test cases page blurb if the page exists. This is something like\n	-- \"See also the companion subpage for [[Template:Foo/testcases|test cases]].\"\n	local testcasesTitle = env.testcasesTitle\n	if testcasesTitle and testcasesTitle.exists then\n		if testcasesTitle.namespace == mw.site.namespaces.Module.id then\n			local testcasesLinkDisplay = message(\'sandbox-notice-testcases-link-display\')\n			local testcasesRunLinkDisplay = message(\'sandbox-notice-testcases-run-link-display\')\n			local testcasesLink = makeWikilink(testcasesTitle.prefixedText, testcasesLinkDisplay)\n			local testcasesRunLink = makeWikilink(testcasesTitle.talkPageTitle.prefixedText, testcasesRunLinkDisplay)\n			text = text .. \'<br />\' .. message(\'sandbox-notice-testcases-run-blurb\', {testcasesLink, testcasesRunLink})\n		else\n			local testcasesLinkDisplay = message(\'sandbox-notice-testcases-link-display\')\n			local testcasesLink = makeWikilink(testcasesTitle.prefixedText, testcasesLinkDisplay)\n			text = text .. \'<br />\' .. message(\'sandbox-notice-testcases-blurb\', {testcasesLink})\n		end\n	end\n	-- Add the sandbox to the sandbox category.\n	text = text .. makeCategoryLink(message(\'sandbox-category\'))\n	omargs.text = text\n	local ret = \'<div style=\"clear: both;\"></div>\'\n	ret = ret .. messageBox.main(\'ombox\', omargs)\n	return ret\nend\n\nfunction p.protectionTemplate(env)\n	-- Generates the padlock icon in the top right.\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- Messages:\n	-- \'protection-template\' --> \'pp-template\'\n	-- \'protection-template-args\' --> {docusage = \'yes\'}\n	local title = env.title\n	local protectionLevels\n	local protectionTemplate = message(\'protection-template\')\n	local namespace = title.namespace\n	if not (protectionTemplate and (namespace == 10 or namespace == 828)) then\n		-- Don\'t display the protection template if we are not in the template or module namespaces.\n		return nil\n	end\n	protectionLevels = env.protectionLevels\n	if not protectionLevels then\n		return nil\n	end\n	local editLevels = protectionLevels.edit\n	local moveLevels = protectionLevels.move\n	if moveLevels and moveLevels[1] == \'sysop\' or editLevels and editLevels[1] then\n		-- The page is full-move protected, or full, template, or semi-protected.\n		local frame = mw.getCurrentFrame()\n		return frame:expandTemplate{title = protectionTemplate, args = message(\'protection-template-args\', nil, \'table\')}\n	else\n		return nil\n	end\nend\n\n----------------------------------------------------------------------------\n-- Start box\n----------------------------------------------------------------------------\n\np.startBox = makeInvokeFunc(\'_startBox\')\n\nfunction p._startBox(args, env)\n	--[[\n	-- This function generates the start box.\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- \n	-- The actual work is done by p.makeStartBoxLinksData and p.renderStartBoxLinks which make\n	-- the [view] [edit] [history] [purge] links, and by p.makeStartBoxData and p.renderStartBox\n	-- which generate the box HTML.\n	--]]\n	env = env or p.getEnvironment(args)\n	local links\n	local content = args.content\n	if not content then\n		-- No need to include the links if the documentation is on the template page itself.\n		local linksData = p.makeStartBoxLinksData(args, env)\n		if linksData then\n			links = p.renderStartBoxLinks(linksData)\n		end\n	end\n	-- Generate the start box html.\n	local data = p.makeStartBoxData(args, env, links)\n	if data then\n		return p.renderStartBox(data)\n	else\n		-- User specified no heading.\n		return nil\n	end\nend\n\nfunction p.makeStartBoxLinksData(args, env)\n	--[[\n	-- Does initial processing of data to make the [view] [edit] [history] [purge] links.\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- \n	-- Messages:\n	-- \'view-link-display\' --> \'view\'\n	-- \'edit-link-display\' --> \'edit\'\n	-- \'history-link-display\' --> \'history\'\n	-- \'purge-link-display\' --> \'purge\'\n	-- \'file-docpage-preload\' --> \'Template:Documentation/preload-filespace\'\n	-- \'module-preload\' --> \'Template:Documentation/preload-module-doc\'\n	-- \'docpage-preload\' --> \'Template:Documentation/preload\'\n	-- \'create-link-display\' --> \'create\'\n	--]]\n	local subjectSpace = env.subjectSpace\n	local title = env.title\n	local docTitle = env.docTitle\n	if not title or not docTitle then\n		return nil\n	end\n\n	local data = {}\n	data.title = title\n	data.docTitle = docTitle\n	-- View, display, edit, and purge links if /doc exists.\n	data.viewLinkDisplay = message(\'view-link-display\')\n	data.editLinkDisplay = message(\'edit-link-display\')\n	data.historyLinkDisplay = message(\'history-link-display\')\n	data.purgeLinkDisplay = message(\'purge-link-display\')\n	-- Create link if /doc doesn\'t exist.\n	local preload = args.preload\n	if not preload then\n		if subjectSpace == 6 then -- File namespace\n			preload = message(\'file-docpage-preload\')\n		elseif subjectSpace == 828 then -- Module namespace\n			preload = message(\'module-preload\')\n		else\n			preload = message(\'docpage-preload\')\n		end\n	end\n	data.preload = preload\n	data.createLinkDisplay = message(\'create-link-display\')\n	return data\nend\n\nfunction p.renderStartBoxLinks(data)\n	--[[\n	-- Generates the [view][edit][history][purge] or [create] links from the data table.\n	-- @data - a table of data generated by p.makeStartBoxLinksData\n	--]]\n	\n	local function escapeBrackets(s)\n		-- Escapes square brackets with HTML entities.\n		s = s:gsub(\'%[\', \'&#91;\') -- Replace square brackets with HTML entities.\n		s = s:gsub(\'%]\', \'&#93;\')\n		return s\n	end\n\n	local ret\n	local docTitle = data.docTitle\n	local title = data.title\n	if docTitle.exists then\n		local viewLink = makeWikilink(docTitle.prefixedText, data.viewLinkDisplay)\n		local editLink = makeUrlLink(docTitle:fullUrl{action = \'edit\'}, data.editLinkDisplay)\n		local historyLink = makeUrlLink(docTitle:fullUrl{action = \'history\'}, data.historyLinkDisplay)\n		local purgeLink = makeUrlLink(title:fullUrl{action = \'purge\'}, data.purgeLinkDisplay)\n		ret = \'[%s] [%s] [%s] [%s]\'\n		ret = escapeBrackets(ret)\n		ret = mw.ustring.format(ret, viewLink, editLink, historyLink, purgeLink)\n	else\n		local createLink = makeUrlLink(docTitle:fullUrl{action = \'edit\', preload = data.preload}, data.createLinkDisplay)\n		ret = \'[%s]\'\n		ret = escapeBrackets(ret)\n		ret = mw.ustring.format(ret, createLink)\n	end\n	return ret\nend\n\nfunction p.makeStartBoxData(args, env, links)\n	--[=[\n	-- Does initial processing of data to pass to the start-box render function, p.renderStartBox.\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- @links - a string containing the [view][edit][history][purge] links - could be nil if there\'s an error.\n	--\n	-- Messages:\n	-- \'documentation-icon-wikitext\' --> \'[[File:Test Template Info-Icon - Version (2).svg|50px|link=|alt=Documentation icon]]\'\n	-- \'template-namespace-heading\' --> \'Template documentation\'\n	-- \'module-namespace-heading\' --> \'Module documentation\'\n	-- \'file-namespace-heading\' --> \'Summary\'\n	-- \'other-namespaces-heading\' --> \'Documentation\'\n	-- \'start-box-linkclasses\' --> \'mw-editsection-like plainlinks\'\n	-- \'start-box-link-id\' --> \'doc_editlinks\'\n	-- \'testcases-create-link-display\' --> \'create\'\n	--]=]\n	local subjectSpace = env.subjectSpace\n	if not subjectSpace then\n		-- Default to an \"other namespaces\" namespace, so that we get at least some output\n		-- if an error occurs.\n		subjectSpace = 2\n	end\n	local data = {}\n	\n	-- Heading\n	local heading = args.heading -- Blank values are not removed.\n	if heading == \'\' then\n		-- Don\'t display the start box if the heading arg is defined but blank.\n		return nil\n	end\n	if heading then\n		data.heading = heading\n	elseif subjectSpace == 10 then -- Template namespace\n		data.heading = message(\'documentation-icon-wikitext\') .. \' \' .. message(\'template-namespace-heading\')\n	elseif subjectSpace == 828 then -- Module namespace\n		data.heading = message(\'documentation-icon-wikitext\') .. \' \' .. message(\'module-namespace-heading\')\n	elseif subjectSpace == 6 then -- File namespace\n		data.heading = message(\'file-namespace-heading\')\n	else\n		data.heading = message(\'other-namespaces-heading\')\n	end\n	\n	-- Heading CSS\n	local headingStyle = args[\'heading-style\']\n	if headingStyle then\n		data.headingStyleText = headingStyle\n	elseif subjectSpace == 10 then\n		-- We are in the template or template talk namespaces.\n		data.headingFontWeight = \'bold\'\n		data.headingFontSize = \'125%\'\n	else\n		data.headingFontSize = \'150%\'\n	end\n	\n	-- Data for the [view][edit][history][purge] or [create] links.\n	if links then\n		data.linksClass = message(\'start-box-linkclasses\')\n		data.linksId = message(\'start-box-link-id\')\n		data.links = links\n	end\n	\n	return data\nend\n\nfunction p.renderStartBox(data)\n	-- Renders the start box html.\n	-- @data - a table of data generated by p.makeStartBoxData.\n	local sbox = mw.html.create(\'div\')\n	sbox\n		:css(\'padding-bottom\', \'3px\')\n		:css(\'border-bottom\', \'1px solid #aaa\')\n		:css(\'margin-bottom\', \'1ex\')\n		:newline()\n		:tag(\'span\')\n			:cssText(data.headingStyleText)\n			:css(\'font-weight\', data.headingFontWeight)\n			:css(\'font-size\', data.headingFontSize)\n			:wikitext(data.heading)\n	local links = data.links\n	if links then\n		sbox:tag(\'span\')\n			:addClass(data.linksClass)\n			:attr(\'id\', data.linksId)\n			:wikitext(links)\n	end\n	return tostring(sbox)\nend\n\n----------------------------------------------------------------------------\n-- Documentation content\n----------------------------------------------------------------------------\n\np.content = makeInvokeFunc(\'_content\')\n\nfunction p._content(args, env)\n	-- Displays the documentation contents\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	env = env or p.getEnvironment(args)\n	local docTitle = env.docTitle\n	local content = args.content\n	if not content and docTitle and docTitle.exists then\n		content = args._content or mw.getCurrentFrame():expandTemplate{title = docTitle.prefixedText}\n	end\n	-- The line breaks below are necessary so that \"=== Headings ===\" at the start and end\n	-- of docs are interpreted correctly.\n	return \'\\n\' .. (content or \'\') .. \'\\n\' \nend\n\np.contentTitle = makeInvokeFunc(\'_contentTitle\')\n\nfunction p._contentTitle(args, env)\n	env = env or p.getEnvironment(args)\n	local docTitle = env.docTitle\n	if not args.content and docTitle and docTitle.exists then\n		return docTitle.prefixedText\n	else\n		return \'\'\n	end\nend\n\n----------------------------------------------------------------------------\n-- End box\n----------------------------------------------------------------------------\n\np.endBox = makeInvokeFunc(\'_endBox\')\n\nfunction p._endBox(args, env)\n	--[=[\n	-- This function generates the end box (also known as the link box).\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- \n	-- Messages:\n	-- \'fmbox-id\' --> \'documentation-meta-data\'\n	-- \'fmbox-style\' --> \'background-color: #ecfcf4\'\n	-- \'fmbox-textstyle\' --> \'font-style: italic\'\n	-- \n	-- The HTML is generated by the {{fmbox}} template, courtesy of [[Module:Message box]].\n	--]=]\n	\n	-- Get environment data.\n	env = env or p.getEnvironment(args)\n	local subjectSpace = env.subjectSpace\n	local docTitle = env.docTitle\n	if not subjectSpace or not docTitle then\n		return nil\n	end\n		\n	-- Check whether we should output the end box at all. Add the end\n	-- box by default if the documentation exists or if we are in the\n	-- user, module or template namespaces.\n	local linkBox = args[\'link box\']\n	if linkBox == \'off\'\n		or not (\n			docTitle.exists\n			or subjectSpace == 2\n			or subjectSpace == 828\n			or subjectSpace == 10\n		)\n	then\n		return nil\n	end\n\n	-- Assemble the arguments for {{fmbox}}.\n	local fmargs = {}\n	fmargs.id = message(\'fmbox-id\') -- Sets \'documentation-meta-data\'\n	fmargs.image = \'none\'\n	fmargs.style = message(\'fmbox-style\') -- Sets \'background-color: #ecfcf4\'\n	fmargs.textstyle = message(\'fmbox-textstyle\') -- \'font-style: italic;\'\n\n	-- Assemble the fmbox text field.\n	local text = \'\'\n	if linkBox then\n		text = text .. linkBox\n	else\n		text = text .. (p.makeDocPageBlurb(args, env) or \'\') -- \"This documentation is transcluded from [[Foo]].\" \n		if subjectSpace == 2 or subjectSpace == 10 or subjectSpace == 828 then\n			-- We are in the user, template or module namespaces.\n			-- Add sandbox and testcases links.\n			-- \"Editors can experiment in this template\'s sandbox and testcases pages.\"\n			text = text .. (p.makeExperimentBlurb(args, env) or \'\')\n			text = text .. \'<br />\'\n			if not args.content and not args[1] then\n				-- \"Please add categories to the /doc subpage.\"\n				-- Don\'t show this message with inline docs or with an explicitly specified doc page,\n				-- as then it is unclear where to add the categories.\n				text = text .. (p.makeCategoriesBlurb(args, env) or \'\')\n			end\n			text = text .. \' \' .. (p.makeSubpagesBlurb(args, env) or \'\') --\"Subpages of this template\"\n			local printBlurb = p.makePrintBlurb(args, env) -- Two-line blurb about print versions of templates.\n			if printBlurb then\n				text = text .. \'<br />\' .. printBlurb\n			end\n		end\n	end\n	fmargs.text = text\n\n	return messageBox.main(\'fmbox\', fmargs)\nend\n\nfunction p.makeDocPageBlurb(args, env)\n	--[=[\n	-- Makes the blurb \"This documentation is transcluded from [[Template:Foo]] (edit, history)\".\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- \n	-- Messages:\n	-- \'edit-link-display\' --> \'edit\'\n	-- \'history-link-display\' --> \'history\'\n	-- \'transcluded-from-blurb\' --> \n	-- \'The above [[Wikipedia:Template documentation|documentation]] \n	-- is [[Wikipedia:Transclusion|transcluded]] from $1.\'\n	-- \'module-preload\' --> \'Template:Documentation/preload-module-doc\'\n	-- \'create-link-display\' --> \'create\'\n	-- \'create-module-doc-blurb\' -->\n	-- \'You might want to $1 a documentation page for this [[Wikipedia:Lua|Scribunto module]].\'\n	--]=]\n	local docTitle = env.docTitle\n	if not docTitle then\n		return nil\n	end\n	local ret\n	if docTitle.exists then\n		-- /doc exists; link to it.\n		local docLink = makeWikilink(docTitle.prefixedText)\n		local editUrl = docTitle:fullUrl{action = \'edit\'}\n		local editDisplay = message(\'edit-link-display\')\n		local editLink = makeUrlLink(editUrl, editDisplay)\n		local historyUrl = docTitle:fullUrl{action = \'history\'}\n		local historyDisplay = message(\'history-link-display\')\n		local historyLink = makeUrlLink(historyUrl, historyDisplay)\n		ret = message(\'transcluded-from-blurb\', {docLink})\n			.. \' \'\n			.. makeToolbar(editLink, historyLink)\n			.. \'<br />\'\n	elseif env.subjectSpace == 828 then\n		-- /doc does not exist; ask to create it.\n		local createUrl = docTitle:fullUrl{action = \'edit\', preload = message(\'module-preload\')}\n		local createDisplay = message(\'create-link-display\')\n		local createLink = makeUrlLink(createUrl, createDisplay)\n		ret = message(\'create-module-doc-blurb\', {createLink})\n			.. \'<br />\'\n	end\n	return ret\nend\n\nfunction p.makeExperimentBlurb(args, env)\n	--[[\n	-- Renders the text \"Editors can experiment in this template\'s sandbox (edit | diff) and testcases (edit) pages.\"\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- \n	-- Messages:\n	-- \'sandbox-link-display\' --> \'sandbox\'\n	-- \'sandbox-edit-link-display\' --> \'edit\'\n	-- \'compare-link-display\' --> \'diff\'\n	-- \'module-sandbox-preload\' --> \'Template:Documentation/preload-module-sandbox\'\n	-- \'template-sandbox-preload\' --> \'Template:Documentation/preload-sandbox\'\n	-- \'sandbox-create-link-display\' --> \'create\'\n	-- \'mirror-edit-summary\' --> \'Create sandbox version of $1\'\n	-- \'mirror-link-display\' --> \'mirror\'\n	-- \'mirror-link-preload\' --> \'Template:Documentation/mirror\'\n	-- \'sandbox-link-display\' --> \'sandbox\'\n	-- \'testcases-link-display\' --> \'testcases\'\n	-- \'testcases-edit-link-display\'--> \'edit\'\n	-- \'template-sandbox-preload\' --> \'Template:Documentation/preload-sandbox\'\n	-- \'testcases-create-link-display\' --> \'create\'\n	-- \'testcases-link-display\' --> \'testcases\'\n	-- \'testcases-edit-link-display\' --> \'edit\'\n	-- \'module-testcases-preload\' --> \'Template:Documentation/preload-module-testcases\'\n	-- \'template-testcases-preload\' --> \'Template:Documentation/preload-testcases\'\n	-- \'experiment-blurb-module\' --> \'Editors can experiment in this module\'s $1 and $2 pages.\'\n	-- \'experiment-blurb-template\' --> \'Editors can experiment in this template\'s $1 and $2 pages.\'\n	--]]\n	local subjectSpace = env.subjectSpace\n	local templateTitle = env.templateTitle\n	local sandboxTitle = env.sandboxTitle\n	local testcasesTitle = env.testcasesTitle\n	local templatePage = templateTitle.prefixedText\n	if not subjectSpace or not templateTitle or not sandboxTitle or not testcasesTitle then\n		return nil\n	end\n	-- Make links.\n	local sandboxLinks, testcasesLinks\n	if sandboxTitle.exists then\n		local sandboxPage = sandboxTitle.prefixedText\n		local sandboxDisplay = message(\'sandbox-link-display\')\n		local sandboxLink = makeWikilink(sandboxPage, sandboxDisplay)\n		local sandboxEditUrl = sandboxTitle:fullUrl{action = \'edit\'}\n		local sandboxEditDisplay = message(\'sandbox-edit-link-display\')\n		local sandboxEditLink = makeUrlLink(sandboxEditUrl, sandboxEditDisplay)\n		local compareUrl = env.compareUrl\n		local compareLink\n		if compareUrl then\n			local compareDisplay = message(\'compare-link-display\')\n			compareLink = makeUrlLink(compareUrl, compareDisplay)\n		end\n		sandboxLinks = sandboxLink .. \' \' .. makeToolbar(sandboxEditLink, compareLink)\n	else\n		local sandboxPreload\n		if subjectSpace == 828 then\n			sandboxPreload = message(\'module-sandbox-preload\')\n		else\n			sandboxPreload = message(\'template-sandbox-preload\')\n		end\n		local sandboxCreateUrl = sandboxTitle:fullUrl{action = \'edit\', preload = sandboxPreload}\n		local sandboxCreateDisplay = message(\'sandbox-create-link-display\')\n		local sandboxCreateLink = makeUrlLink(sandboxCreateUrl, sandboxCreateDisplay)\n		local mirrorSummary = message(\'mirror-edit-summary\', {makeWikilink(templatePage)})\n		local mirrorPreload = message(\'mirror-link-preload\')\n		local mirrorUrl = sandboxTitle:fullUrl{action = \'edit\', preload = mirrorPreload, summary = mirrorSummary}\n		local mirrorDisplay = message(\'mirror-link-display\')\n		local mirrorLink = makeUrlLink(mirrorUrl, mirrorDisplay)\n		sandboxLinks = message(\'sandbox-link-display\') .. \' \' .. makeToolbar(sandboxCreateLink, mirrorLink)\n	end\n	if testcasesTitle.exists then\n		local testcasesPage = testcasesTitle.prefixedText\n		local testcasesDisplay = message(\'testcases-link-display\')\n		local testcasesLink = makeWikilink(testcasesPage, testcasesDisplay)\n		local testcasesEditUrl = testcasesTitle:fullUrl{action = \'edit\'}\n		local testcasesEditDisplay = message(\'testcases-edit-link-display\')\n		local testcasesEditLink = makeUrlLink(testcasesEditUrl, testcasesEditDisplay)\n		testcasesLinks = testcasesLink .. \' \' .. makeToolbar(testcasesEditLink)\n	else\n		local testcasesPreload\n		if subjectSpace == 828 then\n			testcasesPreload = message(\'module-testcases-preload\')\n		else\n			testcasesPreload = message(\'template-testcases-preload\')\n		end\n		local testcasesCreateUrl = testcasesTitle:fullUrl{action = \'edit\', preload = testcasesPreload}\n		local testcasesCreateDisplay = message(\'testcases-create-link-display\')\n		local testcasesCreateLink = makeUrlLink(testcasesCreateUrl, testcasesCreateDisplay)\n		testcasesLinks = message(\'testcases-link-display\') .. \' \' .. makeToolbar(testcasesCreateLink)\n	end\n	local messageName\n	if subjectSpace == 828 then\n		messageName = \'experiment-blurb-module\'\n	else\n		messageName = \'experiment-blurb-template\'\n	end\n	return message(messageName, {sandboxLinks, testcasesLinks})\nend\n\nfunction p.makeCategoriesBlurb(args, env)\n	--[[\n	-- Generates the text \"Please add categories to the /doc subpage.\"\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	-- Messages:\n	-- \'doc-link-display\' --> \'/doc\'\n	-- \'add-categories-blurb\' --> \'Please add categories to the $1 subpage.\'\n	--]]\n	local docTitle = env.docTitle\n	if not docTitle then\n		return nil\n	end\n	local docPathLink = makeWikilink(docTitle.prefixedText, message(\'doc-link-display\'))\n	return message(\'add-categories-blurb\', {docPathLink})\nend\n\nfunction p.makeSubpagesBlurb(args, env)\n	--[[\n	-- Generates the \"Subpages of this template\" link.\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	\n	-- Messages:\n	-- \'template-pagetype\' --> \'template\'\n	-- \'module-pagetype\' --> \'module\'\n	-- \'default-pagetype\' --> \'page\'\n	-- \'subpages-link-display\' --> \'Subpages of this $1\'\n	--]]\n	local subjectSpace = env.subjectSpace\n	local templateTitle = env.templateTitle\n	if not subjectSpace or not templateTitle then\n		return nil\n	end\n	local pagetype\n	if subjectSpace == 10 then\n		pagetype = message(\'template-pagetype\')\n	elseif subjectSpace == 828 then\n		pagetype = message(\'module-pagetype\')\n	else\n		pagetype = message(\'default-pagetype\')\n	end\n	local subpagesLink = makeWikilink(\n		\'Special:PrefixIndex/\' .. templateTitle.prefixedText .. \'/\',\n		message(\'subpages-link-display\', {pagetype})\n	)\n	return message(\'subpages-blurb\', {subpagesLink})\nend\n\nfunction p.makePrintBlurb(args, env)\n	--[=[\n	-- Generates the blurb displayed when there is a print version of the template available.\n	-- @args - a table of arguments passed by the user\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	--\n	-- Messages:\n	-- \'print-link-display\' --> \'/Print\'\n	-- \'print-blurb\' --> \'A [[Help:Books/for experts#Improving the book layout|print version]]\'\n	--		.. \' of this template exists at $1.\'\n	--		.. \' If you make a change to this template, please update the print version as well.\'\n	-- \'display-print-category\' --> true\n	-- \'print-category\' --> \'Templates with print versions\'\n	--]=]\n	local printTitle = env.printTitle\n	if not printTitle then\n		return nil\n	end\n	local ret\n	if printTitle.exists then\n		local printLink = makeWikilink(printTitle.prefixedText, message(\'print-link-display\'))\n		ret = message(\'print-blurb\', {printLink})\n		local displayPrintCategory = message(\'display-print-category\', nil, \'boolean\')\n		if displayPrintCategory then\n			ret = ret .. makeCategoryLink(message(\'print-category\'))\n		end\n	end\n	return ret\nend\n\n----------------------------------------------------------------------------\n-- Tracking categories\n----------------------------------------------------------------------------\n\nfunction p.addTrackingCategories(env)\n	--[[\n	-- Check if {{documentation}} is transcluded on a /doc or /testcases page.\n	-- @env - environment table containing title objects, etc., generated with p.getEnvironment\n	\n	-- Messages:\n	-- \'display-strange-usage-category\' --> true\n	-- \'doc-subpage\' --> \'doc\'\n	-- \'testcases-subpage\' --> \'testcases\'\n	-- \'strange-usage-category\' --> \'Wikipedia pages with strange ((documentation)) usage\'\n	-- \n	-- /testcases pages in the module namespace are not categorised, as they may have\n	-- {{documentation}} transcluded automatically.\n	--]]\n	local title = env.title\n	local subjectSpace = env.subjectSpace\n	if not title or not subjectSpace then\n		return nil\n	end\n	local subpage = title.subpageText\n	local ret = \'\'\n	if message(\'display-strange-usage-category\', nil, \'boolean\')\n		and (\n			subpage == message(\'doc-subpage\')\n			or subjectSpace ~= 828 and subpage == message(\'testcases-subpage\')\n		)\n	then\n		ret = ret .. makeCategoryLink(message(\'strange-usage-category\'))\n	end\n	return ret\nend\n\nreturn p',_binary 'utf-8'),(16,_binary '----------------------------------------------------------------------------------------------------\n--\n--                               Configuration for Module:Documentation\n--\n-- Here you can set the values of the parameters and messages used in Module:Documentation to\n-- localise it to your wiki and your language. Unless specified otherwise, values given here\n-- should be string values.\n----------------------------------------------------------------------------------------------------\n\nlocal cfg = {} -- Do not edit this line.\n\n----------------------------------------------------------------------------------------------------\n-- Protection template configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'protection-template\']\n-- The name of the template that displays the protection icon (a padlock on enwiki).\ncfg[\'protection-template\'] = \'pp-template\'\n\n-- cfg[\'protection-reason-edit\']\n-- The protection reason for edit-protected templates to pass to\n-- [[Module:Protection banner]].\ncfg[\'protection-reason-edit\'] = \'template\'\n\n--[[\n-- cfg[\'protection-template-args\']\n-- Any arguments to send to the protection template. This should be a Lua table.\n-- For example, if the protection template is \"pp-template\", and the wikitext template invocation\n-- looks like \"{{pp-template|docusage=yes}}\", then this table should look like \"{docusage = \'yes\'}\".\n --]]\n cfg[\'protection-template-args\'] = {docusage = \'yes\'}\n\n--[[\n----------------------------------------------------------------------------------------------------\n-- Sandbox notice configuration\n--\n-- On sandbox pages the module can display a template notifying users that the current page is a\n-- sandbox, and the location of test cases pages, etc. The module decides whether the page is a\n-- sandbox or not based on the value of cfg[\'sandbox-subpage\']. The following settings configure the\n-- messages that the notices contains.\n----------------------------------------------------------------------------------------------------\n--]]\n\n-- cfg[\'sandbox-notice-image\']\n-- The image displayed in the sandbox notice.\ncfg[\'sandbox-notice-image\'] = \'[[Image:Sandbox.svg|50px|alt=|link=]]\'\n\n--[[\n-- cfg[\'sandbox-notice-pagetype-template\']\n-- cfg[\'sandbox-notice-pagetype-module\']\n-- cfg[\'sandbox-notice-pagetype-other\']\n-- The page type of the sandbox page. The message that is displayed depends on the current subject\n-- namespace. This message is used in either cfg[\'sandbox-notice-blurb\'] or\n-- cfg[\'sandbox-notice-diff-blurb\'].\n--]]\ncfg[\'sandbox-notice-pagetype-template\'] = \'[[Wikipedia:Template test cases|template sandbox]] page\'\ncfg[\'sandbox-notice-pagetype-module\'] = \'[[Wikipedia:Template test cases|module sandbox]] page\'\ncfg[\'sandbox-notice-pagetype-other\'] = \'sandbox page\'\n\n--[[\n-- cfg[\'sandbox-notice-blurb\']\n-- cfg[\'sandbox-notice-diff-blurb\']\n-- cfg[\'sandbox-notice-diff-display\']\n-- Either cfg[\'sandbox-notice-blurb\'] or cfg[\'sandbox-notice-diff-blurb\'] is the opening sentence\n-- of the sandbox notice. The latter has a diff link, but the former does not. $1 is the page\n-- type, which is either cfg[\'sandbox-notice-pagetype-template\'],\n-- cfg[\'sandbox-notice-pagetype-module\'] or cfg[\'sandbox-notice-pagetype-other\'] depending what\n-- namespace we are in. $2 is a link to the main template page, and $3 is a diff link between\n-- the sandbox and the main template. The display value of the diff link is set by \n-- cfg[\'sandbox-notice-compare-link-display\'].\n--]]\ncfg[\'sandbox-notice-blurb\'] = \'This is the $1 for $2.\'\ncfg[\'sandbox-notice-diff-blurb\'] = \'This is the $1 for $2 ($3).\'\ncfg[\'sandbox-notice-compare-link-display\'] = \'diff\'\n\n--[[\n-- cfg[\'sandbox-notice-testcases-blurb\']\n-- cfg[\'sandbox-notice-testcases-link-display\']\n-- cfg[\'sandbox-notice-testcases-run-blurb\']\n-- cfg[\'sandbox-notice-testcases-run-link-display\']\n-- cfg[\'sandbox-notice-testcases-blurb\'] is a sentence notifying the user that there is a test cases page\n-- corresponding to this sandbox that they can edit. $1 is a link to the test cases page.\n-- cfg[\'sandbox-notice-testcases-link-display\'] is the display value for that link.\n-- cfg[\'sandbox-notice-testcases-run-blurb\'] is a sentence notifying the user that there is a test cases page\n-- corresponding to this sandbox that they can edit, along with a link to run it. $1 is a link to the test\n-- cases page, and $2 is a link to the page to run it.\n-- cfg[\'sandbox-notice-testcases-run-link-display\'] is the display value for the link to run the test\n-- cases.\n--]]\ncfg[\'sandbox-notice-testcases-blurb\'] = \'See also the companion subpage for $1.\'\ncfg[\'sandbox-notice-testcases-link-display\'] = \'test cases\'\ncfg[\'sandbox-notice-testcases-run-blurb\'] = \'See also the companion subpage for $1 ($2).\'\ncfg[\'sandbox-notice-testcases-run-link-display\'] = \'run\'\n\n-- cfg[\'sandbox-category\']\n-- A category to add to all template sandboxes.\ncfg[\'sandbox-category\'] = \'Template sandboxes\'\n\n----------------------------------------------------------------------------------------------------\n-- Start box configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'documentation-icon-wikitext\']\n-- The wikitext for the icon shown at the top of the template.\ncfg[\'documentation-icon-wikitext\'] = \'[[File:Test Template Info-Icon - Version (2).svg|50px|link=|alt=Documentation icon]]\'\n\n-- cfg[\'template-namespace-heading\']\n-- The heading shown in the template namespace.\ncfg[\'template-namespace-heading\'] = \'Template documentation\'\n\n-- cfg[\'module-namespace-heading\']\n-- The heading shown in the module namespace.\ncfg[\'module-namespace-heading\'] = \'Module documentation\'\n\n-- cfg[\'file-namespace-heading\']\n-- The heading shown in the file namespace.\ncfg[\'file-namespace-heading\'] = \'Summary\'\n\n-- cfg[\'other-namespaces-heading\']\n-- The heading shown in other namespaces.\ncfg[\'other-namespaces-heading\'] = \'Documentation\'\n\n-- cfg[\'view-link-display\']\n-- The text to display for \"view\" links.\ncfg[\'view-link-display\'] = \'view\'\n\n-- cfg[\'edit-link-display\']\n-- The text to display for \"edit\" links.\ncfg[\'edit-link-display\'] = \'edit\'\n\n-- cfg[\'history-link-display\']\n-- The text to display for \"history\" links.\ncfg[\'history-link-display\'] = \'history\'\n\n-- cfg[\'purge-link-display\']\n-- The text to display for \"purge\" links.\ncfg[\'purge-link-display\'] = \'purge\'\n\n-- cfg[\'create-link-display\']\n-- The text to display for \"create\" links.\ncfg[\'create-link-display\'] = \'create\'\n\n----------------------------------------------------------------------------------------------------\n-- Link box (end box) configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'transcluded-from-blurb\']\n-- Notice displayed when the docs are transcluded from another page. $1 is a wikilink to that page.\ncfg[\'transcluded-from-blurb\'] = \'The above [[Wikipedia:Template documentation|documentation]] is [[Wikipedia:Transclusion|transcluded]] from $1.\'\n\n--[[\n-- cfg[\'create-module-doc-blurb\']\n-- Notice displayed in the module namespace when the documentation subpage does not exist.\n-- $1 is a link to create the documentation page with the preload cfg[\'module-preload\'] and the\n-- display cfg[\'create-link-display\'].\n--]]\ncfg[\'create-module-doc-blurb\'] = \'You might want to $1 a documentation page for this [[Wikipedia:Lua|Scribunto module]].\'\n\n----------------------------------------------------------------------------------------------------\n-- Experiment blurb configuration\n----------------------------------------------------------------------------------------------------\n\n--[[\n-- cfg[\'experiment-blurb-template\']\n-- cfg[\'experiment-blurb-module\']\n-- The experiment blurb is the text inviting editors to experiment in sandbox and test cases pages.\n-- It is only shown in the template and module namespaces. With the default English settings, it\n-- might look like this:\n--\n-- Editors can experiment in this template\'s sandbox (edit | diff) and testcases (edit) pages.\n--\n-- In this example, \"sandbox\", \"edit\", \"diff\", \"testcases\", and \"edit\" would all be links.\n--\n-- There are two versions, cfg[\'experiment-blurb-template\'] and cfg[\'experiment-blurb-module\'], depending\n-- on what namespace we are in.\n-- \n-- Parameters:\n--\n-- $1 is a link to the sandbox page. If the sandbox exists, it is in the following format:\n--\n--     cfg[\'sandbox-link-display\'] (cfg[\'sandbox-edit-link-display\'] | cfg[\'compare-link-display\'])\n-- \n-- If the sandbox doesn\'t exist, it is in the format:\n--\n--     cfg[\'sandbox-link-display\'] (cfg[\'sandbox-create-link-display\'] | cfg[\'mirror-link-display\'])\n-- \n-- The link for cfg[\'sandbox-create-link-display\'] link preloads the page with cfg[\'template-sandbox-preload\']\n-- or cfg[\'module-sandbox-preload\'], depending on the current namespace. The link for cfg[\'mirror-link-display\']\n-- loads a default edit summary of cfg[\'mirror-edit-summary\'].\n--\n-- $2 is a link to the test cases page. If the test cases page exists, it is in the following format:\n--\n--     cfg[\'testcases-link-display\'] (cfg[\'testcases-edit-link-display\'])\n--\n-- If the test cases page doesn\'t exist, it is in the format:\n-- \n--     cfg[\'testcases-link-display\'] (cfg[\'testcases-create-link-display\'])\n--\n-- If the test cases page doesn\'t exist, the link for cfg[\'testcases-create-link-display\'] preloads the\n-- page with cfg[\'template-testcases-preload\'] or cfg[\'module-testcases-preload\'], depending on the current\n-- namespace.\n--]]\ncfg[\'experiment-blurb-template\'] = \"Editors can experiment in this template\'s $1 and $2 pages.\"\ncfg[\'experiment-blurb-module\'] = \"Editors can experiment in this module\'s $1 and $2 pages.\"\n\n----------------------------------------------------------------------------------------------------\n-- Sandbox link configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'sandbox-subpage\']\n-- The name of the template subpage typically used for sandboxes.\ncfg[\'sandbox-subpage\'] = \'sandbox\'\n\n-- cfg[\'template-sandbox-preload\']\n-- Preload file for template sandbox pages.\ncfg[\'template-sandbox-preload\'] = \'Template:Documentation/preload-sandbox\'\n\n-- cfg[\'module-sandbox-preload\']\n-- Preload file for Lua module sandbox pages.\ncfg[\'module-sandbox-preload\'] = \'Template:Documentation/preload-module-sandbox\'\n\n-- cfg[\'sandbox-link-display\']\n-- The text to display for \"sandbox\" links.\ncfg[\'sandbox-link-display\'] = \'sandbox\'\n\n-- cfg[\'sandbox-edit-link-display\']\n-- The text to display for sandbox \"edit\" links.\ncfg[\'sandbox-edit-link-display\'] = \'edit\'\n\n-- cfg[\'sandbox-create-link-display\']\n-- The text to display for sandbox \"create\" links.\ncfg[\'sandbox-create-link-display\'] = \'create\'\n\n-- cfg[\'compare-link-display\']\n-- The text to display for \"compare\" links.\ncfg[\'compare-link-display\'] = \'diff\'\n\n-- cfg[\'mirror-edit-summary\']\n-- The default edit summary to use when a user clicks the \"mirror\" link. $1 is a wikilink to the\n-- template page.\ncfg[\'mirror-edit-summary\'] = \'Create sandbox version of $1\'\n\n-- cfg[\'mirror-link-display\']\n-- The text to display for \"mirror\" links.\ncfg[\'mirror-link-display\'] = \'mirror\'\n\n-- cfg[\'mirror-link-preload\']\n-- The page to preload when a user clicks the \"mirror\" link.\ncfg[\'mirror-link-preload\'] = \'Template:Documentation/mirror\'\n\n----------------------------------------------------------------------------------------------------\n-- Test cases link configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'testcases-subpage\']\n-- The name of the template subpage typically used for test cases.\ncfg[\'testcases-subpage\'] = \'testcases\'\n\n-- cfg[\'template-testcases-preload\']\n-- Preload file for template test cases pages.\ncfg[\'template-testcases-preload\'] = \'Template:Documentation/preload-testcases\'\n\n-- cfg[\'module-testcases-preload\']\n-- Preload file for Lua module test cases pages.\ncfg[\'module-testcases-preload\'] = \'Template:Documentation/preload-module-testcases\'\n\n-- cfg[\'testcases-link-display\']\n-- The text to display for \"testcases\" links.\ncfg[\'testcases-link-display\'] = \'testcases\'\n\n-- cfg[\'testcases-edit-link-display\']\n-- The text to display for test cases \"edit\" links.\ncfg[\'testcases-edit-link-display\'] = \'edit\'\n\n-- cfg[\'testcases-create-link-display\']\n-- The text to display for test cases \"create\" links.\ncfg[\'testcases-create-link-display\'] = \'create\'\n\n----------------------------------------------------------------------------------------------------\n-- Add categories blurb configuration\n----------------------------------------------------------------------------------------------------\n\n--[[\n-- cfg[\'add-categories-blurb\']\n-- Text to direct users to add categories to the /doc subpage. Not used if the \"content\" or\n-- \"docname fed\" arguments are set, as then it is not clear where to add the categories. $1 is a\n-- link to the /doc subpage with a display value of cfg[\'doc-link-display\'].\n--]]\ncfg[\'add-categories-blurb\'] = \'Please add categories to the $1 subpage.\'\n\n-- cfg[\'doc-link-display\']\n-- The text to display when linking to the /doc subpage.\ncfg[\'doc-link-display\'] = \'/doc\'\n\n----------------------------------------------------------------------------------------------------\n-- Subpages link configuration\n----------------------------------------------------------------------------------------------------\n\n--[[\n-- cfg[\'subpages-blurb\']\n-- The \"Subpages of this template\" blurb. $1 is a link to the main template\'s subpages with a\n-- display value of cfg[\'subpages-link-display\']. In the English version this blurb is simply\n-- the link followed by a period, and the link display provides the actual text.\n--]]\ncfg[\'subpages-blurb\'] = \'$1.\'\n\n--[[\n-- cfg[\'subpages-link-display\']\n-- The text to display for the \"subpages of this page\" link. $1 is cfg[\'template-pagetype\'],\n-- cfg[\'module-pagetype\'] or cfg[\'default-pagetype\'], depending on whether the current page is in\n-- the template namespace, the module namespace, or another namespace.\n--]]\ncfg[\'subpages-link-display\'] = \'Subpages of this $1\'\n\n-- cfg[\'template-pagetype\']\n-- The pagetype to display for template pages.\ncfg[\'template-pagetype\'] = \'template\'\n\n-- cfg[\'module-pagetype\']\n-- The pagetype to display for Lua module pages.\ncfg[\'module-pagetype\'] = \'module\'\n\n-- cfg[\'default-pagetype\']\n-- The pagetype to display for pages other than templates or Lua modules.\ncfg[\'default-pagetype\'] = \'page\'\n\n----------------------------------------------------------------------------------------------------\n-- Doc link configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'doc-subpage\']\n-- The name of the subpage typically used for documentation pages.\ncfg[\'doc-subpage\'] = \'doc\'\n\n-- cfg[\'file-docpage-preload\']\n-- Preload file for documentation page in the file namespace.\ncfg[\'file-docpage-preload\'] = \'Template:Documentation/preload-filespace\'\n\n-- cfg[\'docpage-preload\']\n-- Preload file for template documentation pages in all namespaces.\ncfg[\'docpage-preload\'] = \'Template:Documentation/preload\'\n\n-- cfg[\'module-preload\']\n-- Preload file for Lua module documentation pages.\ncfg[\'module-preload\'] = \'Template:Documentation/preload-module-doc\'\n\n----------------------------------------------------------------------------------------------------\n-- Print version configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'print-subpage\']\n-- The name of the template subpage used for print versions.\ncfg[\'print-subpage\'] = \'Print\'\n\n-- cfg[\'print-link-display\']\n-- The text to display when linking to the /Print subpage.\ncfg[\'print-link-display\'] = \'/Print\'\n\n-- cfg[\'print-blurb\']\n-- Text to display if a /Print subpage exists. $1 is a link to the subpage with a display value of cfg[\'print-link-display\'].\ncfg[\'print-blurb\'] = \'A [[Help:Books/for experts#Improving the book layout|print version]] of this template exists at $1.\'\n	.. \' If you make a change to this template, please update the print version as well.\'\n\n-- cfg[\'display-print-category\']\n-- Set to true to enable output of cfg[\'print-category\'] if a /Print subpage exists.\n-- This should be a boolean value (either true or false).\ncfg[\'display-print-category\'] = true\n\n-- cfg[\'print-category\']\n-- Category to output if cfg[\'display-print-category\'] is set to true, and a /Print subpage exists.\ncfg[\'print-category\'] = \'Templates with print versions\'\n\n----------------------------------------------------------------------------------------------------\n-- HTML and CSS configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'main-div-id\']\n-- The \"id\" attribute of the main HTML \"div\" tag.\ncfg[\'main-div-id\'] = \'template-documentation\'\n\n-- cfg[\'main-div-classes\']\n-- The CSS classes added to the main HTML \"div\" tag.\ncfg[\'main-div-classes\'] = \'template-documentation iezoomfix\'\n\n-- cfg[\'start-box-linkclasses\']\n-- The CSS classes used for the [view][edit][history] or [create] links in the start box.\ncfg[\'start-box-linkclasses\'] = \'mw-editsection-like plainlinks\'\n\n-- cfg[\'start-box-link-id\']\n-- The HTML \"id\" attribute for the links in the start box.\ncfg[\'start-box-link-id\'] = \'doc_editlinks\'\n\n----------------------------------------------------------------------------------------------------\n-- {{fmbox}} template configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'fmbox-id\']\n-- The id sent to the \"id\" parameter of the {{fmbox}} template.\ncfg[\'fmbox-id\'] = \'documentation-meta-data\'\n\n-- cfg[\'fmbox-style\']\n-- The value sent to the style parameter of {{fmbox}}.\ncfg[\'fmbox-style\'] = \'background-color: #ecfcf4\'\n\n-- cfg[\'fmbox-textstyle\']\n-- The value sent to the \"textstyle parameter of {{fmbox}}.\ncfg[\'fmbox-textstyle\'] = \'font-style: italic\'\n\n----------------------------------------------------------------------------------------------------\n-- Tracking category configuration\n----------------------------------------------------------------------------------------------------\n\n-- cfg[\'display-strange-usage-category\']\n-- Set to true to enable output of cfg[\'strange-usage-category\'] if the module is used on a /doc subpage\n-- or a /testcases subpage. This should be a boolean value (either true or false).\ncfg[\'display-strange-usage-category\'] = true\n\n-- cfg[\'strange-usage-category\']\n-- Category to output if cfg[\'display-strange-usage-category\'] is set to true and the module is used on a\n-- /doc subpage or a /testcases subpage.\ncfg[\'strange-usage-category\'] = \'Wikipedia pages with strange ((documentation)) usage\'\n\n--[[\n----------------------------------------------------------------------------------------------------\n-- End configuration\n--\n-- Don\'t edit anything below this line.\n----------------------------------------------------------------------------------------------------\n--]]\n\nreturn cfg',_binary 'utf-8'),(17,_binary 'This module displays a blue box containing documentation for [[WP:TEMPLATE|templates]], [[WP:MODULE|Lua modules]], or other pages. The {{tl|documentation}} template invokes it.\n\n== Normal usage ==\n\nFor most uses, you should use the {{tl|documentation}} template; please see that template\'s page for its usage instructions and parameters.\n\n== Use in other modules ==\n\nTo use this module from another Lua module, first load it with <code>require</code>:\n\n<source lang=\"lua\">\nlocal documentation = require(\'Module:Documentation\').main\n</source>\n\nThen you can simply call it using a table of arguments.\n<source lang=\"lua\">\ndocumentation{content = \'Some documentation\', [\'link box\'] = \'My custom link box\'}\n</source>\n\nPlease refer to the [[Template:Documentation/doc|template documentation]] for usage instructions and a list of parameters.\n\n== Porting to other wikis ==\n\nThe module has a configuration file at [[Module:Documentation/config]] which is intended to allow easy translation and porting to other wikis. Please see the code comments in the config page for instructions. If you have any questions, or you need a feature which is not currently implemented, please leave a message at [[Template talk:Documentation]] to get the attention of a developer.',_binary 'utf-8'),(18,_binary '-- This is a meta-module for producing message box templates, including\n-- {{mbox}}, {{ambox}}, {{imbox}}, {{tmbox}}, {{ombox}}, {{cmbox}} and {{fmbox}}.\n\n-- Load necessary modules.\nrequire(\'Module:No globals\')\nlocal getArgs\nlocal categoryHandler = require(\'Module:Category handler\')._main\nlocal yesno = require(\'Module:Yesno\')\n\n-- Get a language object for formatDate and ucfirst.\nlocal lang = mw.language.getContentLanguage()\n\n--------------------------------------------------------------------------------\n-- Helper functions\n--------------------------------------------------------------------------------\n\nlocal function getTitleObject(...)\n	-- Get the title object, passing the function through pcall\n	-- in case we are over the expensive function count limit.\n	local success, title = pcall(mw.title.new, ...)\n	if success then\n		return title\n	end\nend\n\nlocal function union(t1, t2)\n	-- Returns the union of two arrays.\n	local vals = {}\n	for i, v in ipairs(t1) do\n		vals[v] = true\n	end\n	for i, v in ipairs(t2) do\n		vals[v] = true\n	end\n	local ret = {}\n	for k in pairs(vals) do\n		table.insert(ret, k)\n	end\n	table.sort(ret)\n	return ret\nend\n\nlocal function getArgNums(args, prefix)\n	local nums = {}\n	for k, v in pairs(args) do\n		local num = mw.ustring.match(tostring(k), \'^\' .. prefix .. \'([1-9]%d*)$\')\n		if num then\n			table.insert(nums, tonumber(num))\n		end\n	end\n	table.sort(nums)\n	return nums\nend\n\n--------------------------------------------------------------------------------\n-- Box class definition\n--------------------------------------------------------------------------------\n\nlocal MessageBox = {}\nMessageBox.__index = MessageBox\n\nfunction MessageBox.new(boxType, args, cfg)\n	args = args or {}\n	local obj = {}\n\n	-- Set the title object and the namespace.\n	obj.title = getTitleObject(args.page) or mw.title.getCurrentTitle()\n\n	-- Set the config for our box type.\n	obj.cfg = cfg[boxType]\n	if not obj.cfg then\n		local ns = obj.title.namespace\n		-- boxType is \"mbox\" or invalid input\n		if ns == 0 then\n			obj.cfg = cfg.ambox -- main namespace\n		elseif ns == 6 then\n			obj.cfg = cfg.imbox -- file namespace\n		elseif ns == 14 then\n			obj.cfg = cfg.cmbox -- category namespace\n		else\n			local nsTable = mw.site.namespaces[ns]\n			if nsTable and nsTable.isTalk then\n				obj.cfg = cfg.tmbox -- any talk namespace\n			else\n				obj.cfg = cfg.ombox -- other namespaces or invalid input\n			end\n		end\n	end\n\n	-- Set the arguments, and remove all blank arguments except for the ones\n	-- listed in cfg.allowBlankParams.\n	do\n		local newArgs = {}\n		for k, v in pairs(args) do\n			if v ~= \'\' then\n				newArgs[k] = v\n			end\n		end\n		for i, param in ipairs(obj.cfg.allowBlankParams or {}) do\n			newArgs[param] = args[param]\n		end\n		obj.args = newArgs\n	end\n\n	-- Define internal data structure.\n	obj.categories = {}\n	obj.classes = {}\n\n	return setmetatable(obj, MessageBox)\nend\n\nfunction MessageBox:addCat(ns, cat, sort)\n	if not cat then\n		return nil\n	end\n	if sort then\n		cat = string.format(\'[[Category:%s|%s]]\', cat, sort)\n	else\n		cat = string.format(\'[[Category:%s]]\', cat)\n	end\n	self.categories[ns] = self.categories[ns] or {}\n	table.insert(self.categories[ns], cat)\nend\n\nfunction MessageBox:addClass(class)\n	if not class then\n		return nil\n	end\n	table.insert(self.classes, class)\nend\n\nfunction MessageBox:setParameters()\n	local args = self.args\n	local cfg = self.cfg\n\n	-- Get type data.\n	self.type = args.type\n	local typeData = cfg.types[self.type]\n	self.invalidTypeError = cfg.showInvalidTypeError\n		and self.type\n		and not typeData\n	typeData = typeData or cfg.types[cfg.default]\n	self.typeClass = typeData.class\n	self.typeImage = typeData.image\n\n	-- Find if the box has been wrongly substituted.\n	self.isSubstituted = cfg.substCheck and args.subst == \'SUBST\'\n\n	-- Find whether we are using a small message box.\n	self.isSmall = cfg.allowSmall and (\n		cfg.smallParam and args.small == cfg.smallParam\n		or not cfg.smallParam and yesno(args.small)\n	)\n\n	-- Add attributes, classes and styles.\n	self.id = args.id\n	self:addClass(\n		cfg.usePlainlinksParam and yesno(args.plainlinks or true) and \'plainlinks\'\n	)\n	for _, class in ipairs(cfg.classes or {}) do\n		self:addClass(class)\n	end\n	if self.isSmall then\n		self:addClass(cfg.smallClass or \'mbox-small\')\n	end\n	self:addClass(self.typeClass)\n	self:addClass(args.class)\n	self.style = args.style\n	self.attrs = args.attrs\n\n	-- Set text style.\n	self.textstyle = args.textstyle\n\n	-- Find if we are on the template page or not. This functionality is only\n	-- used if useCollapsibleTextFields is set, or if both cfg.templateCategory\n	-- and cfg.templateCategoryRequireName are set.\n	self.useCollapsibleTextFields = cfg.useCollapsibleTextFields\n	if self.useCollapsibleTextFields\n		or cfg.templateCategory\n		and cfg.templateCategoryRequireName\n	then\n		self.name = args.name\n		if self.name then\n			local templateName = mw.ustring.match(\n				self.name,\n				\'^[tT][eE][mM][pP][lL][aA][tT][eE][%s_]*:[%s_]*(.*)$\'\n			) or self.name\n			templateName = \'Template:\' .. templateName\n			self.templateTitle = getTitleObject(templateName)\n		end\n		self.isTemplatePage = self.templateTitle\n			and mw.title.equals(self.title, self.templateTitle)\n	end\n\n	-- Process data for collapsible text fields. At the moment these are only\n	-- used in {{ambox}}.\n	if self.useCollapsibleTextFields then\n		-- Get the self.issue value.\n		if self.isSmall and args.smalltext then\n			self.issue = args.smalltext\n		else\n			local sect\n			if args.sect == \'\' then\n				sect = \'This \' .. (cfg.sectionDefault or \'page\')\n			elseif type(args.sect) == \'string\' then\n				sect = \'This \' .. args.sect\n			end\n			local issue = args.issue\n			issue = type(issue) == \'string\' and issue ~= \'\' and issue or nil\n			local text = args.text\n			text = type(text) == \'string\' and text or nil\n			local issues = {}\n			table.insert(issues, sect)\n			table.insert(issues, issue)\n			table.insert(issues, text)\n			self.issue = table.concat(issues, \' \')\n		end\n\n		-- Get the self.talk value.\n		local talk = args.talk\n		-- Show talk links on the template page or template subpages if the talk\n		-- parameter is blank.\n		if talk == \'\'\n			and self.templateTitle\n			and (\n				mw.title.equals(self.templateTitle, self.title)\n				or self.title:isSubpageOf(self.templateTitle)\n			)\n		then\n			talk = \'#\'\n		elseif talk == \'\' then\n			talk = nil\n		end\n		if talk then\n			-- If the talk value is a talk page, make a link to that page. Else\n			-- assume that it\'s a section heading, and make a link to the talk\n			-- page of the current page with that section heading.\n			local talkTitle = getTitleObject(talk)\n			local talkArgIsTalkPage = true\n			if not talkTitle or not talkTitle.isTalkPage then\n				talkArgIsTalkPage = false\n				talkTitle = getTitleObject(\n					self.title.text,\n					mw.site.namespaces[self.title.namespace].talk.id\n				)\n			end\n			if talkTitle and talkTitle.exists then\n				local talkText = \'Relevant discussion may be found on\'\n				if talkArgIsTalkPage then\n					talkText = string.format(\n						\'%s [[%s|%s]].\',\n						talkText,\n						talk,\n						talkTitle.prefixedText\n					)\n				else\n					talkText = string.format(\n						\'%s the [[%s#%s|talk page]].\',\n						talkText,\n						talkTitle.prefixedText,\n						talk\n					)\n				end\n				self.talk = talkText\n			end\n		end\n\n		-- Get other values.\n		self.fix = args.fix ~= \'\' and args.fix or nil\n		local date\n		if args.date and args.date ~= \'\' then\n			date = args.date\n		elseif args.date == \'\' and self.isTemplatePage then\n			date = lang:formatDate(\'F Y\')\n		end\n		if date then\n			self.date = string.format(\" <small>\'\'(%s)\'\'</small>\", date)\n		end\n		self.info = args.info\n	end\n\n	-- Set the non-collapsible text field. At the moment this is used by all box\n	-- types other than ambox, and also by ambox when small=yes.\n	if self.isSmall then\n		self.text = args.smalltext or args.text\n	else\n		self.text = args.text\n	end\n\n	-- Set the below row.\n	self.below = cfg.below and args.below\n\n	-- General image settings.\n	self.imageCellDiv = not self.isSmall and cfg.imageCellDiv\n	self.imageEmptyCell = cfg.imageEmptyCell\n	if cfg.imageEmptyCellStyle then\n		self.imageEmptyCellStyle = \'border:none;padding:0px;width:1px\'\n	end\n\n	-- Left image settings.\n	local imageLeft = self.isSmall and args.smallimage or args.image\n	if cfg.imageCheckBlank and imageLeft ~= \'blank\' and imageLeft ~= \'none\'\n		or not cfg.imageCheckBlank and imageLeft ~= \'none\'\n	then\n		self.imageLeft = imageLeft\n		if not imageLeft then\n			local imageSize = self.isSmall\n				and (cfg.imageSmallSize or \'30x30px\')\n				or \'40x40px\'\n			self.imageLeft = string.format(\'[[File:%s|%s|link=|alt=]]\', self.typeImage\n				or \'Imbox notice.png\', imageSize)\n		end\n	end\n\n	-- Right image settings.\n	local imageRight = self.isSmall and args.smallimageright or args.imageright\n	if not (cfg.imageRightNone and imageRight == \'none\') then\n		self.imageRight = imageRight\n	end\nend\n\nfunction MessageBox:setMainspaceCategories()\n	local args = self.args\n	local cfg = self.cfg\n\n	if not cfg.allowMainspaceCategories then\n		return nil\n	end\n\n	local nums = {}\n	for _, prefix in ipairs{\'cat\', \'category\', \'all\'} do\n		args[prefix .. \'1\'] = args[prefix]\n		nums = union(nums, getArgNums(args, prefix))\n	end\n\n	-- The following is roughly equivalent to the old {{Ambox/category}}.\n	local date = args.date\n	date = type(date) == \'string\' and date\n	local preposition = \'from\'\n	for _, num in ipairs(nums) do\n		local mainCat = args[\'cat\' .. tostring(num)]\n			or args[\'category\' .. tostring(num)]\n		local allCat = args[\'all\' .. tostring(num)]\n		mainCat = type(mainCat) == \'string\' and mainCat\n		allCat = type(allCat) == \'string\' and allCat\n		if mainCat and date and date ~= \'\' then\n			local catTitle = string.format(\'%s %s %s\', mainCat, preposition, date)\n			self:addCat(0, catTitle)\n			catTitle = getTitleObject(\'Category:\' .. catTitle)\n			if not catTitle or not catTitle.exists then\n				self:addCat(0, \'Articles with invalid date parameter in template\')\n			end\n		elseif mainCat and (not date or date == \'\') then\n			self:addCat(0, mainCat)\n		end\n		if allCat then\n			self:addCat(0, allCat)\n		end\n	end\nend\n\nfunction MessageBox:setTemplateCategories()\n	local args = self.args\n	local cfg = self.cfg\n\n	-- Add template categories.\n	if cfg.templateCategory then\n		if cfg.templateCategoryRequireName then\n			if self.isTemplatePage then\n				self:addCat(10, cfg.templateCategory)\n			end\n		elseif not self.title.isSubpage then\n			self:addCat(10, cfg.templateCategory)\n		end\n	end\n\n	-- Add template error categories.\n	if cfg.templateErrorCategory then\n		local templateErrorCategory = cfg.templateErrorCategory\n		local templateCat, templateSort\n		if not self.name and not self.title.isSubpage then\n			templateCat = templateErrorCategory\n		elseif self.isTemplatePage then\n			local paramsToCheck = cfg.templateErrorParamsToCheck or {}\n			local count = 0\n			for i, param in ipairs(paramsToCheck) do\n				if not args[param] then\n					count = count + 1\n				end\n			end\n			if count > 0 then\n				templateCat = templateErrorCategory\n				templateSort = tostring(count)\n			end\n			if self.categoryNums and #self.categoryNums > 0 then\n				templateCat = templateErrorCategory\n				templateSort = \'C\'\n			end\n		end\n		self:addCat(10, templateCat, templateSort)\n	end\nend\n\nfunction MessageBox:setAllNamespaceCategories()\n	-- Set categories for all namespaces.\n	if self.invalidTypeError then\n		local allSort = (self.title.namespace == 0 and \'Main:\' or \'\') .. self.title.prefixedText\n		self:addCat(\'all\', \'Wikipedia message box parameter needs fixing\', allSort)\n	end\n	if self.isSubstituted then\n		self:addCat(\'all\', \'Pages with incorrectly substituted templates\')\n	end\nend\n\nfunction MessageBox:setCategories()\n	if self.title.namespace == 0 then\n		self:setMainspaceCategories()\n	elseif self.title.namespace == 10 then\n		self:setTemplateCategories()\n	end\n	self:setAllNamespaceCategories()\nend\n\nfunction MessageBox:renderCategories()\n	-- Convert category tables to strings and pass them through\n	-- [[Module:Category handler]].\n	return categoryHandler{\n		main = table.concat(self.categories[0] or {}),\n		template = table.concat(self.categories[10] or {}),\n		all = table.concat(self.categories.all or {}),\n		nocat = self.args.nocat,\n		page = self.args.page\n	}\nend\n\nfunction MessageBox:export()\n	local root = mw.html.create()\n\n	-- Add the subst check error.\n	if self.isSubstituted and self.name then\n		root:tag(\'b\')\n			:addClass(\'error\')\n			:wikitext(string.format(\n				\'Template <code>%s[[Template:%s|%s]]%s</code> has been incorrectly substituted.\',\n				mw.text.nowiki(\'{{\'), self.name, self.name, mw.text.nowiki(\'}}\')\n			))\n	end\n\n	-- Create the box table.\n	local boxTable = root:tag(\'table\')\n	boxTable:attr(\'id\', self.id or nil)\n	for i, class in ipairs(self.classes or {}) do\n		boxTable:addClass(class or nil)\n	end\n	boxTable\n		:cssText(self.style or nil)\n		:attr(\'role\', \'presentation\')\n\n	if self.attrs then\n		boxTable:attr(self.attrs)\n	end\n\n	-- Add the left-hand image.\n	local row = boxTable:tag(\'tr\')\n	if self.imageLeft then\n		local imageLeftCell = row:tag(\'td\'):addClass(\'mbox-image\')\n		if self.imageCellDiv then\n			-- If we are using a div, redefine imageLeftCell so that the image\n			-- is inside it. Divs use style=\"width: 52px;\", which limits the\n			-- image width to 52px. If any images in a div are wider than that,\n			-- they may overlap with the text or cause other display problems.\n			imageLeftCell = imageLeftCell:tag(\'div\'):css(\'width\', \'52px\')\n		end\n		imageLeftCell:wikitext(self.imageLeft or nil)\n	elseif self.imageEmptyCell then\n		-- Some message boxes define an empty cell if no image is specified, and\n		-- some don\'t. The old template code in templates where empty cells are\n		-- specified gives the following hint: \"No image. Cell with some width\n		-- or padding necessary for text cell to have 100% width.\"\n		row:tag(\'td\')\n			:addClass(\'mbox-empty-cell\')\n			:cssText(self.imageEmptyCellStyle or nil)\n	end\n\n	-- Add the text.\n	local textCell = row:tag(\'td\'):addClass(\'mbox-text\')\n	if self.useCollapsibleTextFields then\n		-- The message box uses advanced text parameters that allow things to be\n		-- collapsible. At the moment, only ambox uses this.\n		textCell:cssText(self.textstyle or nil)\n		local textCellSpan = textCell:tag(\'span\')\n		textCellSpan\n			:addClass(\'mbox-text-span\')\n			:wikitext(self.issue or nil)\n		if not self.isSmall then\n			textCellSpan:tag(\'span\')\n				:addClass(\'hide-when-compact\')\n				:wikitext(self.talk and (\' \' .. self.talk) or nil)\n				:wikitext(self.fix and (\' \' .. self.fix) or nil)\n		end\n		textCellSpan:wikitext(self.date and (\' \' .. self.date) or nil)\n		if not self.isSmall then\n			textCellSpan\n				:tag(\'span\')\n				:addClass(\'hide-when-compact\')\n				:wikitext(self.info and (\' \' .. self.info) or nil)\n		end\n	else\n		-- Default text formatting - anything goes.\n		textCell\n			:cssText(self.textstyle or nil)\n			:wikitext(self.text or nil)\n	end\n\n	-- Add the right-hand image.\n	if self.imageRight then\n		local imageRightCell = row:tag(\'td\'):addClass(\'mbox-imageright\')\n		if self.imageCellDiv then\n			-- If we are using a div, redefine imageRightCell so that the image\n			-- is inside it.\n			imageRightCell = imageRightCell:tag(\'div\'):css(\'width\', \'52px\')\n		end\n		imageRightCell\n			:wikitext(self.imageRight or nil)\n	end\n\n	-- Add the below row.\n	if self.below then\n		boxTable:tag(\'tr\')\n			:tag(\'td\')\n				:attr(\'colspan\', self.imageRight and \'3\' or \'2\')\n				:addClass(\'mbox-text\')\n				:cssText(self.textstyle or nil)\n				:wikitext(self.below or nil)\n	end\n\n	-- Add error message for invalid type parameters.\n	if self.invalidTypeError then\n		root:tag(\'div\')\n			:css(\'text-align\', \'center\')\n			:wikitext(string.format(\n				\'This message box is using an invalid \"type=%s\" parameter and needs fixing.\',\n				self.type or \'\'\n			))\n	end\n\n	-- Add categories.\n	root:wikitext(self:renderCategories() or nil)\n\n	return tostring(root)\nend\n\n--------------------------------------------------------------------------------\n-- Exports\n--------------------------------------------------------------------------------\n\nlocal p, mt = {}, {}\n\nfunction p._exportClasses()\n	-- For testing.\n	return {\n		MessageBox = MessageBox\n	}\nend\n\nfunction p.main(boxType, args, cfgTables)\n	local box = MessageBox.new(boxType, args, cfgTables or mw.loadData(\'Module:Message box/configuration\'))\n	box:setParameters()\n	box:setCategories()\n	return box:export()\nend\n\nfunction mt.__index(t, k)\n	return function (frame)\n		if not getArgs then\n			getArgs = require(\'Module:Arguments\').getArgs\n		end\n		return t.main(k, getArgs(frame, {trim = false, removeBlanks = false}))\n	end\nend\n\nreturn setmetatable(p, mt)',_binary 'utf-8'),(19,_binary '--------------------------------------------------------------------------------\n--                          Message box configuration                         --\n--                                                                            --\n-- This module contains configuration data for [[Module:Message box]].        --\n--------------------------------------------------------------------------------\n\nreturn {\n	ambox = {\n		types = {\n			speedy = {\n				class = \'ambox-speedy\',\n				image = \'Ambox warning pn.svg\'\n			},\n			delete = {\n				class = \'ambox-delete\',\n				image = \'Ambox warning pn.svg\'\n			},\n			warning = { -- alias for content\n				class = \'ambox-content\',\n				image = \'Ambox important.svg\'\n			},\n			content = {\n				class = \'ambox-content\',\n				image = \'Ambox important.svg\'\n			},\n			style = {\n				class = \'ambox-style\',\n				image = \'Edit-clear.svg\'\n			},\n			move = {\n				class = \'ambox-move\',\n				image = \'Merge-split-transwiki default.svg\'\n			},\n			protection = {\n				class = \'ambox-protection\',\n				image = \'Padlock-silver-medium.svg\'\n			},\n			notice = {\n				class = \'ambox-notice\',\n				image = \'Information icon4.svg\'\n			}\n		},\n		default                     = \'notice\',\n		allowBlankParams            = {\'talk\', \'sect\', \'date\', \'issue\', \'fix\', \'subst\', \'hidden\'},\n		allowSmall                  = true,\n		smallParam                  = \'left\',\n		smallClass                  = \'mbox-small-left\',\n		substCheck                  = true,\n		classes                     = {\'metadata\', \'plainlinks\', \'ambox\'},\n		imageEmptyCell              = true,\n		imageCheckBl