--------------------------------------------------------\n \nlocal cfg = {} -- Don\'t edit this line.\n \n--------------------------------------------------------------------------------\n--                              Parameter names                               --\n-- These configuration items specify custom parameter names. Values added     --\n-- here will work in addition to the default English parameter names.         --\n-- To add one extra name, you can use this format:                            --\n--                                                                            --\n-- cfg.foo = \'parameter name\'                                                 --\n--                                                                            --\n-- To add multiple names, you can use this format:                            --\n--                                                                            --\n-- cfg.foo = {\'parameter name 1\', \'parameter name 2\', \'parameter name 3\'}     --\n--------------------------------------------------------------------------------\n \n---- This parameter displays content for the main namespace:\n-- cfg.main = \'main\'\n \n---- This parameter displays in talk namespaces:\n-- cfg.talk = \'talk\'\n \n---- This parameter displays content for \"other\" namespaces (namespaces for which\n---- parameters have not been specified):\n-- cfg.other = \'other\'\n \n---- This parameter makes talk pages behave as though they are the corresponding\n---- subject namespace. Note that this parameter is used with [[Module:Yesno]].\n---- Edit that module to change the default values of \"yes\", \"no\", etc.\n-- cfg.subjectns = \'subjectns\'\n \n---- This parameter sets a demonstration namespace:\n-- cfg.demospace = \'demospace\'\n \n---- This parameter sets a specific page to compare:\ncfg.demopage = \'page\'\n \n--------------------------------------------------------------------------------\n--                           Table configuration                              --\n-- These configuration items allow customisation of the \"table\" function,     --\n-- used to generate a table of possible parameters in the module              --\n-- documentation.                                                             --\n--------------------------------------------------------------------------------\n \n---- The header for the namespace column in the wikitable containing the list of\n---- possible subject-space parameters.\n-- cfg.wikitableNamespaceHeader = \'Namespace\'\n \n---- The header for the wikitable containing the list of possible subject-space\n---- parameters.\n-- cfg.wikitableAliasesHeader = \'Aliases\'\n \n--------------------------------------------------------------------------------\n--                        End of configuration data                           --\n--------------------------------------------------------------------------------\n \nreturn cfg -- Don\'t edit this line.',_binary 'utf-8'),(21,_binary '--------------------------------------------------------------------------------\n--                          Namespace detect data                             --\n-- This module holds data for [[Module:Namespace detect]] to be loaded per    --\n-- page, rather than per #invoke, for performance reasons.                    --\n--------------------------------------------------------------------------------\n \nlocal cfg = require(\'Module:Namespace detect/config\')\n \nlocal function addKey(t, key, defaultKey)\n	if key ~= defaultKey then\n		t[#t + 1] = key\n	end\nend\n \n-- Get a table of parameters to query for each default parameter name.\n-- This allows wikis to customise parameter names in the cfg table while\n-- ensuring that default parameter names will always work. The cfg table\n-- values can be added as a string, or as an array of strings.\n \nlocal defaultKeys = {\n	\'main\',\n	\'talk\',\n	\'other\',\n	\'subjectns\',\n	\'demospace\',\n	\'demopage\'\n}\n \nlocal argKeys = {}\nfor i, defaultKey in ipairs(defaultKeys) do\n	argKeys[defaultKey] = {defaultKey}\nend\n \nfor defaultKey, t in pairs(argKeys) do\n	local cfgValue = cfg[defaultKey]\n	local cfgValueType = type(cfgValue)\n	if cfgValueType == \'string\' then\n		addKey(t, cfgValue, defaultKey)\n	elseif cfgValueType == \'table\' then\n		for i, key in ipairs(cfgValue) do\n			addKey(t, key, defaultKey)\n		end\n	end\n	cfg[defaultKey] = nil -- Free the cfg value as we don\'t need it any more.\nend\n \nlocal function getParamMappings()\n	--[[\n	-- Returns a table of how parameter names map to namespace names. The keys\n	-- are the actual namespace names, in lower case, and the values are the\n	-- possible parameter names for that namespace, also in lower case. The\n	-- table entries are structured like this:\n	-- {\n	--   [\'\'] = {\'main\'},\n	--   [\'wikipedia\'] = {\'wikipedia\', \'project\', \'wp\'},\n	--   ...\n	-- }\n	--]]\n	local mappings = {}\n	local mainNsName = mw.site.subjectNamespaces[0].name\n	mainNsName = mw.ustring.lower(mainNsName)\n	mappings[mainNsName] = mw.clone(argKeys.main)\n	mappings[\'talk\'] = mw.clone(argKeys.talk)\n	for nsid, ns in pairs(mw.site.subjectNamespaces) do\n		if nsid ~= 0 then -- Exclude main namespace.\n			local nsname = mw.ustring.lower(ns.name)\n			local canonicalName = mw.ustring.lower(ns.canonicalName)\n			mappings[nsname] = {nsname}\n			if canonicalName ~= nsname then\n				table.insert(mappings[nsname], canonicalName)\n			end\n			for _, alias in ipairs(ns.aliases) do\n				table.insert(mappings[nsname], mw.ustring.lower(alias))\n			end\n		end\n	end\n	return mappings\nend\n \nreturn {\n	argKeys = argKeys,\n	cfg = cfg,\n	mappings = getParamMappings()\n}',_binary 'utf-8'),(22,_binary 'local mt = getmetatable(_G) or {}\nfunction mt.__index (t, k)\n	if k ~= \'arg\' then\n		error(\'Tried to read nil global \' .. tostring(k), 2)\n	end\n	return nil\nend\nfunction mt.__newindex(t, k, v)\n	if k ~= \'arg\' then\n		error(\'Tried to write global \' .. tostring(k), 2)\n	end\n	rawset(t, k, v)\nend\nsetmetatable(_G, mt)',_binary 'utf-8'),(23,_binary '-- Function allowing for consistent treatment of boolean-like wikitext input.\n-- It works similarly to the template {{yesno}}.\n\nreturn function (val, default)\n	-- If your wiki uses non-ascii characters for any of \"yes\", \"no\", etc., you\n	-- should replace \"val:lower()\" with \"mw.ustring.lower(val)\" in the\n	-- following line.\n	val = type(val) == \'string\' and val:lower() or val\n	if val == nil then\n		return nil\n	elseif val == true \n		or val == \'yes\'\n		or val == \'y\'\n		or val == \'true\'\n		or val == \'t\'\n		or tonumber(val) == 1\n	then\n		return true\n	elseif val == false\n		or val == \'no\'\n		or val == \'n\'\n		or val == \'false\'\n		or val == \'f\'\n		or tonumber(val) == 0\n	then\n		return false\n	else\n		return default\n	end\nend',_binary 'utf-8'),(24,_binary '|',_binary 'utf-8'),(25,_binary '<noinclude>{{Documentation}}</noinclude><includeonly>__NOTOC__\n<div class=\"row\" style=\"width: 100%;\">\n<div class=\"col-sm-3\">\n[[File:Armes-8993.png|200px|{{PAGENAME}}]]\n\n</div>\n<div class=\"col-sm-9\">\n<div class=\"row\">\n<div class=\"col-xs-6 text-left\">\n== Type : {{{type}}} ==\n</div>\n<div class=\"col-xs-6 text-right\">\n== Niveau : [[Niveau::{{{niveau}}}| ]]{{{niveau}}} ==\n</div>\n</div>\n== Description ==\n{{{description}}}\n\n<div class=\"row\">\n<div class=\"col-sm-6\">\n== Effets ==\n{| class=\"wikitable\" align=center style=\"width: 100%;\"\n{{#vardefine: i | 0 }}{{#while:\n | {{{stat{{#var: i }} |}}}\n | <nowiki />\n<tr><td><div class=\"row\"><div class=\"col-sm-10\">{{{stat{{#var: i }} }}}</div><div class=\"col-sm-2 text-right\">[[Fichier:Air.png|20px]]</div></div></td></tr>{{#vardefine: i\n   | {{#expr: {{#var: i }} + 1 }}\n }}\n}}\n|}\n</div>\n\n<div class=\"col-sm-6\">\n== Caractéristiques ==\n{| class=\"wikitable\" align=center style=\"width: 100%;\"\n| <div class=\"row\"><div class=\"col-sm-10\">PA : {{#if:{{{PA}}}|{{{PA}}}}}</d