includeonly>',_binary 'utf-8'),(49,_binary '<includeonly>{{{value}}}{{#if: {{{last-element|}}} | |<br/>}}</includeonly>',_binary 'utf-8'),(50,_binary '#REDIRECT[[Template:Tlx]]',_binary 'utf-8'),(51,_binary '<span style=\"font-family:&quot;Consolas&quot;, monospace;\">{{[[{{#if:{{{SISTER|}}}|{{{SISTER}}}Template|{{ns:Template}}}}:{{{1|Tlx}}}|{{{1|Tlx}}}]]{{#if:{{{2|}}}|&#124;{{{2}}}}}{{#if:{{{3|}}}|&#124;{{{3}}}}}{{#if:{{{4|}}}|&#124;{{{4}}}}}{{#if:{{{5|}}}|&#124;{{{5}}}}}{{#if:{{{6|}}}|&#124;{{{6}}}}}{{#if:{{{7|}}}|&#124;{{{7}}}}}{{#if:{{{8|}}}|&#124;\'\'...\'\'}}}}</span><noinclude>\n{{documentation}}\n</noinclude>',_binary 'utf-8'),(52,_binary '<includeonly><indicator name=\"id\">{{Badge|align=right|bg-color=#dee7f8|border=|style=font-size: 85%|content=<b>Type : {{{1|}}}</b>}}</indicator></includeonly>',_binary 'utf-8'),(53,_binary '__NOTOC__\n<div class=\"row\">\n<div class=\"col col-md-6\">\n== Déjà implanté ==\n\n== À implanter ==\n=== Sur Dofapi ===\n* Les équipements ([[Template:Equipement|Template]] et [[Cagoule de Vortex]])\n* Les armes ([[Template:Arme|Template]] et [[Epée Maudite du Saigneur Guerrier]])\n* Les Ressources ([[Template:Ressource|Template]] et [[Perce-Neige]])\n* Les consommables ([[Template:Consommable|Template]] et [[Pain de Frostiz soufflé]])\n* Les montures ([[Template:Monture|Template]] et [[Dragodinde Amande]])\n* Les panoplies\n* Les familiers ([[Template:Familier|Template]] et Familier)\n\n==== Bientôt ====\n* Les monstres ([[Template:Monstre|Template]] et [[Tofu]])\n\n=== Pas sur Dofapi ===\n* Les compagnons\n* Les cartes (avec les éléments présents dessus)\n* Les quêtes journalières et hebdomadaires (Prérequis ? Suite de quête ? PNJ de début/fin, récompense, matériaux nécessaires)\n* Les PNJ (Débute/fini une quete ? Vend qqch ?)\n* Les zones (Monstres/ressources/...)\n* Les métiers\n* Les recettes\n* Les succès (points, obtention)\n* Les titres (obtention)\n* Les ornements (obtention)\n* Les idoles (recette, effets)\n* Les monnaies: kamas de glace, reliques, ... (obtention, où échanger, quoi échanger)\n* Moyens de transport: Zaapis, zaap, transporteurs, bateaux, diligences, ... (prix, conditions ?)\n* Les classes\n* Les sorts\n* Les objets d’apparat\n* Almanax\n* Havre-sac\n* Les ateliers\n* Les maisons\n* Les enclos\n* Les banques/tavernes/milices/Hdv\n* Les temples\n* Les Dofus\n* Les harnachements\n* Les donjons\n* Les guildes\n* Les personnages\n* Les serveurs\n* Les mines\n* Patchs\n* Mises à jour\n* Les Challenges\n</div>\n<div class=\"col col-md-6\">\n\n== Point technique ==\n=== Recette ===\nAfficher les recettes d\'une manière similaire à wowhead: [https://fr.wowhead.com/item=58480/vrai-or#created-by-spell Vrai-or]\n\nPour les recettes, possibilité d\'arborescence si l\'item de la recette est craftable lui aussi.\n=== Images ===\nTélécharger et uploader tous les icones pour equipements/ressources/...\n=== Bot Discord ===\nInutile de réinventer la roue pour le moment. Le bot [https://github.com/Kaysoro/KaellyBot Kaelly] fonctionne très bien.\n\n== A corriger ==\n* Le script pour récupérer les caractéristiques des armes/équipements ne prend en compte que le \"from\" + \"to\", et non le \"from\" tout seul. (exemple: [[Epée de Boisaille]])\n* Meilleure gestion du tableau affichant les stats. Il y a trop de blanc en dessous.\n* Il faut gérer le cas particulier de l\'[[Epée Maudite du Saigneur Guerrier]] et de ses caractéristiques étranges.\n* Supprimer les liens dans les tableaux en bas de page. ([https://www.semantic-mediawiki.org/wiki/Help:Displaying_information#URL|Documentation])\n\n== Merci ==\nMerci à <b>@Red Magnetic Skywalker</b> de m\'avoir aidé à parser l\'API.\n</div>',_binary 'utf-8'),(54,_binary '__NOTOC__\n<div class=\"row\">\n<div class=\"col col-md-6\">\n== Déjà implanté ==\n\n== À implanter ==\n=== Sur Dofapi ===\n* Les équipements ([[Template:Equipement|Template]] et [[Cagoule de Vortex]])\n* Les armes ([[Template:Arme|Template]] et [[Epée Maudite du Saigneur Guerrier]])\n* Les Ressources ([[Template:Ressource|Template]] et [[Perce-Neige]])\n* Les consommables ([[Template:Consommable|Template]] et [[Pain de Frostiz soufflé]])\n* Les montures ([[Template:Monture|Template]] et [[Dragodinde Amande]])\n* Les panoplies\n* Les familiers ([[Template:Familier|Template]] et Familier)\n* Les harnachements\n* Les monstres ([[Template:Monstre|Template]] et [[Tofu]])\n* Les métiers\n* Les Dofus (sont dans les équipements)\n\n==== Bientôt ====\n* Les idoles\n* Les sorts\n* Les classes\n* Les compagnons\n* Les recettes\n* Les havres-sacs\n\n=== Pas sur Dofapi ===\n* Les compagnons\n* Les cartes (avec les éléments présents dessus)\n* Les quêtes journalières et hebdomadaires (Prérequis ? Suite de quête ? PNJ de début/fin, récompense, matériaux nécessaires)\n* Les PNJ (Débute/fini une quete ? Vend qqch ?)\n* Les zones (Monstres/ressources/...)\n* Les succès (points, obtention)\n* Les titres (obtention)\n* Les ornements (obtention)\n* Les monnaies: kamas de glace, reliques, ... (obtention, où échanger, quoi échanger)\n* Moyens de transport: Zaapis, zaap, transporteurs, bateaux, diligences, ... (prix, conditions ?)\n* Les objets d’apparat\n* Almanax\n* Les ateliers\n* Les maisons\n* Les enclos\n* Les banques/tavernes/milices/Hdv\n* Les temples\n* Les donjons\n* Les guildes\n* Les personnages\n* Les serveurs\n* Les mines\n* Patchs\n* Mises à jour\n* Les Challenges\n</div>\n<div class=\"col col-md-6\">\n\n== Point technique ==\n=== Recette ===\nAfficher les recettes d\'une manière similaire à wowhead: [https://fr.wowhead.com/item=58480/vrai-or#created-by-spell Vrai-or]\n\nPour les recettes, possibilité d\'arborescence si l\'item de la recette est craftable lui aussi.\n=== Images ===\nTélécharger et uploader tous les icones pour equipements/ressources/...\n=== Bot Discord ===\nInutile de réinventer la roue pour le moment. Le bot [https://github.com/Kaysoro/KaellyBot Kaelly] fonctionne très bien.\n\n== A corriger ==\n* Le script pour récupérer les caractéristiques des armes/équipements ne prend en compte que le \"from\" + \"to\", et non le \"from\" tout seul. (exemple: [[Epée de Boisaille]])\n* Meilleure gestion du tableau affichant les stats. Il y a trop de blanc en dessous.\n* Il faut gérer le cas particulier de l\'[[Epée Maudite du Saigneur Guerrier]] et de ses caractéristiques étranges.\n* Supprimer les liens dans les tableaux en bas de page. ([https://www.semantic-mediawiki.org/wiki/Help:Displaying_information#URL|Documentation])\n\n== Merci ==\nMerci à <b>@Red Magnetic Skywalker</b> de m\'avoir aidé à parser l\'API.\n</div>',_binary 'utf-8');
